{"title": "All D.C. students would pursue higher education under council chief\u2019s proposal", "doc_id": "645525a0-3649-11e1-afdf-67906fc95149", "author": "Tim Craig and; Emma Brown", "annotation": "690-0", "published_date": "2012/01/03", "content_str": "The D.C. Council will consider mandating that all city high school students complete college admission testing and seek out higher education, Chairman Kwame R. Brown announced Tuesday. The legislation, which Brown (D) plans to introduce Wednesday, is a dramatic and provocative step that was praised for being well-intentioned but faulted as unrealistic. Under the bill, all 75,000 students in D.C. public schools, including charters, would have to take the SAT or ACT college entrance exam to graduate from high school. Every student would also be required to complete \u201cat least one\u201d application for admission to college or vocational or trade school \u2014 even if the student does not intend to continue schooling beyond 12th grade. If approved, according to several education advocates, the District would have among the most aggressive requirements in the nation for prodding students to pursue college. But Brown\u2019s bill makes no exceptions for students who want to join the military or seek a career that does not require a degree. \u201cI\u2019m not saying everyone should go to college, but, my goodness, we have to get more young folks prepared to go to college if they want to go college,\u201d Brown said. \u201cA lot of them don\u2019t even know how to prepare to apply to go to college. They have never seen a college application. We have to set high expectations.\u201d Requiring students to take college entrance exams is not a new idea \u2014 at least 11 states do so, according to the Education Commission of the States. Experts say that taking such tests \u2014 and teaching teens and parents how to interpret the results \u2014 can be a powerful way to help more students prepare for higher education. \u201cThere\u2019s a lot of evidence that many families, particularly low-income families, don\u2019t know what\u2019s involved in going to college and being ready to go to college,\u201d said Brookings Institution education scholar Grover \u201cRuss\u201d Whitehurst. \u201cMaking that information available while there\u2019s still time to act has been shown to be important.\u201d But Whitehurst said requiring students to apply to a postsecondary institution could make a mockery of the process. \u201cYou don\u2019t want people to go through a sham process of application, nor do you want to subject colleges and universities to receiving such applications,\u201d Whitehurst said. \u201cIt takes motivation to attend college and succeed, and you can\u2019t force it.\u201d High schools should be concerned about preparing students for college, not preparing them for a perfunctory application process, said Barmak Nassirian, associate executive director of the American Association of Collegiate Registrars and Admissions Officers. \u201cI recognize that this is a good-faith effort to move forward, but I think it would be better to focus on what is actually under control of the high school,\u201d he said. \u201cWhat good does it do for them to require students to ritualistically apply to college?\u201d Brown counters that D.C. students need an extra push to convince them that a college education is attainable. He notes that the city\u2019s public schools have an on-time graduation rate of 43\u00a0percent, according to some calculations, and that more than half of its students qualify for free or reduced-price school meals. Under the bill, which Brown said will be one of his priorities this year, all city schools will be required to offer seminars on how to apply for postsecondary institutions. \u201cWe know the impact that even one workshop can make on a parent or student,\u201d said Argelia Rodriguez, president of the District of Columbia College Access Program, a nonprofit organization that provides college and financial aid counselors in all of the city\u2019s public and public charter high schools. (Washington Post Co. Chairman and Chief Executive Donald E. Graham sits on the organization\u2019s board of directors.) The Office of the State Superintendent of Education estimates that 51\u00a0percent of the District\u2019s 2010 graduates enrolled in a degree-granting institution within a year of receiving a diploma from a public high school. According to the College Board, fewer than half of the students in the class of 2011 took the SAT. Since being elected to the council in 2004, Brown has hosted annual college tours in which he has accompanied dozens of students on visits to universities. On those tours, Brown said, he discovered that many D.C. youths do not realize that financial aid is available and that college is a realistic option for many of them. For example, under the congressionally authorized D.C. Tuition Assistance Grant Program, city students are eligible for up to $10,000 a year in tuition assistance to attend public universities throughout the country. \u201cWhen you are dealing with these young folks, they want to better themselves, they want to go to college,\u201d Brown said. Brown said that a District-wide standard for college preparation evens out opportunities across a system that includes both poor-performing inner city schools and highly sought-out charter and specialized public schools. Students at the high-performing public School Without Walls in Northwest Washington, for example, are required to fill out at least three college applications and are strongly encouraged to take the SAT, said Principal Richard Trogisch. Many of the city\u2019s charter schools also provide intensive college counseling and test-preparation courses. Under a new evaluation system, charters are judged according to students\u2019 SAT performance and college acceptance rate, and conversations about higher education often begin early. Three-year-olds beginning school at KIPP DC campuses last fall began talking right away about the year they would graduate from high school and enter college: 2026.", "default_text": [[" The D.C. Council will consider mandating that all city high school students complete college admission testing and seek out higher education . The legislation is a dramatic and provocative step that was praised for being well-intentioned but faulted as unrealistic ."], [" At least 11 states require students to take college entrance exams, according to the Education Commission of the States . Experts say such tests can be a powerful way to help more students prepare for higher education ."], [" High schools should be concerned about preparing students for college, not preparing them for a perfunctory application process, an admissions officer says . D.C. students need an extra push to convince them that a college education is attainable, Brown says ."], [" All city schools will be required to offer seminars on how to apply for postsecondary institutions . More than half of the city's students qualify for free or reduced-price meals ."], [" Since being elected to the council in 2004, Brown has hosted annual college tours in which he has accompanied dozens of students on visits to universities . Under the congressionally authorized D.C. Tuition Assistance Grant Program, city students are eligible for up to $10,000 a year in tuition assistance to attend public universities ."], [" Many charter schools provide intensive college counseling and test-preparation courses . Under a new evaluation system, charters are judged according to students\u2019 SAT performance and college acceptance rate ."]], "default_vector": [[0.3718218207359314, -0.13278958201408386, 0.6503233909606934, 0.5368452072143555, -0.47207534313201904, -0.14952117204666138, 0.27373525500297546, -0.006054111290723085, 0.3130309581756592, -0.2710517942905426, 0.17185179889202118, 0.12365055829286575, 0.4714767038822174, -0.115892067