{"title": "New study shows architecture, arts degrees yield highest unemployment", "doc_id": "88c19ce4-3657-11e1-9ee3-fd35588e7629", "author": "Peter Whoriskey", "annotation": "690-0", "published_date": "2012/01/04", "content_str": "College kids may choose to spend their campus days studying the glories of Plato, Shakespeare and Le Corbusier. But, as a new study points out, there may be a steep price to pay. Recent college graduates with bachelor\u2019s degrees in the arts, humanities and architecture experienced significantly higher rates of joblessness, according to a study being released Wednesday by Georgetown University\u2019s Center on Education and the Workforce. Among recent college graduates, those with the highest rates of unemployment had undergraduate degrees in architecture (13.9\u00a0percent), the arts (11.1\u00a0percent) and the humanities (9.4\u00a0percent), according to the study. The recent college graduates with the lowest rates of unemployment had degrees in health (5.4\u00a0percent), education (5.4\u00a0percent), and agriculture and natural resources (7\u00a0percent.) Those with business and engineering degrees also fared relatively well. \u201cPeople keep telling kids to study what they love \u2014 but some loves are worth more than others,\u201d said Anthony P. Carnevale, one of the study\u2019s authors. \u201cWhen people talk about college, there are all these high-minded ideas about it making people better citizens and participating fully in the life of their times. All that\u2019s true, but go talk to the unemployed about that.\u201d The analysis, which was based on 2009 and 2010 data from the Census Bureau\u2019s American Community Survey, comes amid an increasing debate over the value of college education as an economic investment. Over the past two decades, the average amount of debt a student takes on has roughly doubled in real terms, leading to greater scrutiny of the financial returns of college. Carnevale and his team have also quantified the value of various majors in terms of wages. Over a lifetime, the earnings of workers who have majored in engineering, computer science or business were as much as 50\u00a0percent higher than the earnings of those who majored in the humanities, the arts, education and psychology. \u201cIf I had been any better at math, I might have gone into engineering \u2014 I would have liked to have an automatic job right out of college,\u201d said Stephanie Kerner, a recent graduate with a degree in political science and psychology from Oglethorpe University. \u201cBecause, let\u2019s be honest, no one wants to struggle like this.\u201d Kerner became unemployed in March after a brief job as a medical receptionist was cut. She has about $50,000 in student debt. \u201cI think you should go to school for what you love, but you should understand what you\u2019re getting yourself into,\u201d she added. Erin Hayes graduated in the spring of 2010 with a degree in political science from the University of North Carolina Charlotte. Saddled with $28,000 in college debt, she is now again living with her father. The difficulty of the job market led her to seek a master\u2019s degree in the fall, more quickly than she\u2019d planned. Her recent job-seeking efforts have included a first interview at Barnes and Noble, a \u201cno, thank you\u201d e-mail from Target and attempts at temp agencies. She remains unemployed. \u201cPolitical science teaches you how to think,\u201d she said. But \u201ccollege should prepare students better for actual real life. You really should come out with some transferable skills.\u201d Whatever the woes of college graduates, however, the authors of the study opined that college is \u201cworth it.\u201d While unemployment among recent college graduates stood at 8.9\u00a0percent, the rates were much, much higher among job seekers with less education. Unemployment among those with a recent high school diploma was 22.9\u00a0percent, and 31.5 percent of recent high school dropouts were without a job. Results did vary by field, however. Even across relatively similar fields, unemployment rates could be significantly different. For example, the unemployment rate for recent college graduates in information systems was 11.7\u00a0percent, while the rates for majors in computer science was 7.8\u00a0percent. Unemployment rates were generally higher among those with degrees in non-technical fields, the authors said. Majors aligned with particular occupations and industries \u2014 such as education and health \u2014 tended to show lower unemployment rates. Even so, there appear to be few hard and fast rules. Graduates with degrees in architecture, which is closely linked with the construction industry, showed the highest levels of unemployment. The collapse of the housing industry has curtailed job prospects. \u201cIt\u2019s slim pickings out there, that\u2019s for sure,\u201d said Valerie Berstene, who graduated in May from Catholic University of America with a master\u2019s degree in architecture. \u201cIt\u2019s challenging in ways that I never anticipated.\u201d Although she has thought about pursuing other fields, she has no regrets about sticking with the field that she is devoted to. \u201cIf I left for another field, I would miss architecture too much,\u201d she said.", "default_text": [[" Recent college graduates with bachelor\u2019s degrees in the arts, humanities and architecture experienced significantly higher rates of joblessness . Georgetown University study: Those with the highest rates of unemployment had degrees in architecture (13.9%) Those with business and engineering degrees fared relatively well ."], [" The study was based on 2009 and 2010 data from the Census Bureau\u2019s American Community Survey . It comes amid an increasing debate over the value of college education as an economic investment . The average amount of debt a student takes on has roughly doubled in real terms ."], [" Stephanie Kerner became unemployed in March after a brief job as a medical receptionist was cut . She has about $50,000 in student debt . Erin Hayes graduated in the spring of 2010 with a degree in political science from the University of North Carolina Charlotte ."], [" Unemployment among recent college graduates stood at 8.9 percent, but rates were much, much higher among job seekers with less education . Authors of the study opined that college is \u201cworth it. ow to think,\u201d she said ."], [" Graduates with degrees in architecture showed the highest levels of unemployment . The collapse of the housing industry has curtailed job prospects ."]], "default_vector": [[0.2038121521472931, 0.7671687006950378, -0.555211067199707, -0.18534480035305023, 0.3155819773674011, 1.08979332447052, -0.47335270047187805, 0.35307204723358154, -0.455260306596756, -0.0931485965847969, 0.057483505457639694, 0.6084786057472229, 0.1507268249988556, -0.17201955616474152, 0.289421945810318, -0.35258227586746216, -0.5894694924354553, -0.018936483189463615, -0.568710446357727, 0.29852980375289917, -0.7064722776412964, 0.8529288172721863, -0.5264347195625305, -0.17717932164669037, 0.07462523877620697, -0.2197016030550003, 0.4211529791355133, -0.18199020624160767, -0.49097970128059387, -0.1854756474494934, 0.37302538752555847, 0.0498124323785305, -0.10546278208494186, -0.529906690120697, -0.51666659116745, 0.25654786825180054, 0.2910914719104767, -0.34748613834381104, 0.6229800581932068, 0.18607138097286224, -0.044110365211963654, -0.15890124440193176, 0.37131136655807495, -0.2388819009065628, -0.06060799956321716, -0.1111244261264801, 0.7703834772109985, 0.43661144375801086, -0.25120046734809875, -0.3947542905807495, 0.6441908478736877, 0.06331939250230789, 0.6018128395080566, 0.047893691807985306, 0.34158220887184143, 0.010044950991868973, -0.11813077330589294, 0.39835646748542786, 0.46635961532592773, -0.32399195432662964, 0.6391332745552063, 0.13319841027259827, -0.5612799525260925, 0.19598707556724548, -