{"title": null, "doc_id": "1854a584-331c-11e1-a274-61fcdeecc5f5", "author": "Rita Zeidner", "annotation": "805-0", "published_date": "2012/01/12", "content_str": "Ask Kevin Green about his research into Wellington Villa, south of Alexandria, and his eyes light up mischievously. A resident of the mile-long enclave tucked between the George Washington Memorial Parkway and the Potomac River a few miles south of Old Town, he rattled some of the area\u2019s long-timers by challenging a beloved piece of neighborhood lore. Locals have long maintained that a ferry frequently mentioned in George Washington\u2019s diaries operated from the neighborhood\u2019s shoreline. Called Clifton\u2019s Ferry, it connected the colonial settlement of Hatton Point in Prince George\u2019s County with farmland in Virginia that William Clifton sold to George Washington in 1760. The land now occupied by Wellington Villa, and by several adjacent communities on both sides of the George Washington Memorial Parkway, was part of that purchase. \u201cI can\u2019t tell you how many people I\u2019ve spoken to say Clifton\u2019s Ferry ran out their back door,\u201d he said. \u201cI guess people like to be able to say, \u2018George Washington slept here.\u2019\u200a\u201d Green, an Alexandria native who moved with his family to Wellington Villa from Chevy Chase in 1989, was drawn by the neighborhood\u2019s layered history and laid-back ambiance. But he was skeptical about the story that the Clifton\u2019s Ferry landing was within the neighborhood\u2019s boundaries. After studying old maps at the Library of Congress and comparing them with contemporary maps of Fairfax County, he concluded that the landing had been about a half-mile south, where the river is much narrower. If anyone has bragging rights, it\u2019s the residents of the Arcturus neighborhood, just south of Wellington Villa, according to a historical researcher with the Fairfax County library system who, at the request of a reporter, examined contemporary and historical maps of the area and reached the same conclusion as Green. A home with a view Wellington Villa doesn\u2019t appeal only to history buffs. For nature lovers such as Don and Elizabeth Robinson, the major attraction was the waterfront access. Avid canoeists who had long yearned to live on the water, they bought a dilapidated 1,700-square-foot bungalow on a half-acre for about $440,000 in 1992. \u201cWe\u2019ve basically been in remodeling mode ever since,\u201d says Don Robinson, ticking off various enhancements he added over the years, mostly to maximize their view of the Potomac. Among them: floor-to-ceiling windows in the living room and master bedroom, and a spacious deck on the back of the house, which faces the water. The couple set aside a portion of the basement for Don to build a workshop and pursue his hobby of restoring vintage boats. An added plus: The house is close enough to Old Town, where Elizabeth works as a social worker, that she can sneak home during lunch breaks to walk the couple\u2019s two dogs. Don, a physical therapist, also enjoys a short, hassle-free commute to work at a nearby hospital. Living on the water\u2019s edge has heightened the Robinsons\u2019 awareness of complex environmental problems, they say. They volunteer as river stewards with the U.S. Park Service and help to restore habitat at Dyke Marsh, a nearby wildlife refuge where they say invasive plants are choking native species and wreaking havoc on the local ecosystem. The Robinsons say their knowledge of colonial Virginia was sketchy before they moved to the neighborhood, but that has changed. Like many who live in the area, they have become George Washington groupies. Given his interest in the environment, Don Robinson found it particularly fascinating that Washington had run an expansive, highly profitable shad and herring fishing operation  along the Potomac River. \u201cWith the shad restoration efforts going on in the Potomac now, I feel like I have a real link to history,\u201d he said. Changing times Of course, Wellington Villa now bears little resemblance to the fishing and farming community that 250 years ago was part of George Washington\u2019s estate. Some of the most dramatic changes have come in the past 15 years, according to Mimi Laughlin, who moved to the neighborhood in the early 1960s when her husband, Robert, began his career as an anthropologist with the Smithsonian Institution, where he is now a curator emeritus. The couple had been house-hunting for a year when they fell in love with a house on a hill overlooking the river that previous owners had converted from an old dairy barn. When the Laughlins arrived, the neighborhood had a distinct Bohemian vibe, Mimi Laughlin said. One of her neighbors owned a donkey. Another was rumored to be a bootlegger. The Laughlins, who had spent years living in Mexico and had their own eclectic way of doing things, fit in perfectly. For a while, Mimi Laughlin raised chickens that, like the donkey, were not exactly in line with local zoning rules. Robert commuted to work via motorboat, mooring at the marina on Maine Avenue and jogging the rest of the way to his office on the Mall. Things began to change in Wellington Villa during the 1990s, when most of the onetime summer homes and crab shacks that had dotted the community were razed to make way for much larger luxury homes. Today, all but about 100 feet of the community\u2019s private, mile-long perimeter road is paved, mostly at the homeowners\u2019 expense. Unlike earlier residents, well-heeled newcomers were bothered by the potholes and were willing to pay for road improvements out of their own pockets. Today, demand for housing in Wellington Villa is fierce, particularly along the waterfront, according to realtor Phyllis Patterson of Coldwell Banker. \u201cPeople are very specific. Many would love to have a river home,\u201d she said. Not surprisingly, housing prices are high, even for this affluent area of Fairfax County. A three-bedroom 1950s rambler on three-quarters of an acre without riverfront access is on the market now for nearly $1.4 million. Some of the newer houses that replaced older, more modest dwellings on smaller plots on the water sold for millions more. The fact that some longtime residents living on the shoreline are unwilling to sell to developers and clearly are uninterested in keeping up with the Joneses creates local color and adds to the community\u2019s mystique, Patterson said. \u201cYou see people on the street walking their dogs, and they have the beat-up T-shirt and the flip-flops, and one person lives in a 1,000-square-foot home and the other lives in a 12,000-square-foot home, and they all get along just fine,\u201d she said. Rita Zeidner is a freelance writer.", "default_text": [[" Wellington Villa is a mile-long enclave tucked between the George Washington Memorial Parkway and the Potomac River . Locals have long maintained that a ferry frequently mentioned in George Washington\u2019s diaries operated from the shoreline . The land now occupied by Wellington Villa was part of the purchase by William Clifton in 1760 ."], [" The Clifton\u2019s Ferry landing was not within Wellington Villa's boundaries . A researcher with the Fairfax County library system examined contemporary and historical maps of the area . He concluded that the landing had been about a half-mile south ."], [" The Robinsons bought a dilapidated 1,700-square-foot bungalow on a half-acre for about $440,000 in 1992 . The couple set aside a portion of the basement for Don to build a workshop and pursue his hobby of restoring vintage boats ."], [" Residents say invasive plants are choking native species and wreaking havoc on the local ecosystem . The Robinsons say their knowledge of colonial Virginia was sketchy before they moved to the neighborhood, but that has changed ."], [" Robert and Mimi Laughlin lived in Wellington Villa, Washington, for more than a decade . Robert Laughlin is an anthropologist with the Smithsonian Institution, where he is now a curator emeritus . The Laughlins, who had spent years living in Mexico and had their own eclectic way of doing things, fit in perfectly ."], [" Well-heeled newcomers were bothered by the potholes and were willing to pay for road improvements out of their own pockets . Today, demand for housing in Wellington Villa is fierce, particularly along the waterfront ."], [" \u201cYou see people on the street walking their dogs, and they have the beat-up T-shirt and the flip-flops,\u201d Patterson says . unity\u2019s mystique, Patterson said . \u201cOne person lives in a 1,000-square-foot home and the other lives . in a 12,000 square foot home, she said ."]], "default_vector": [[1.3068087100982666, 0.11864236742258072, 0.061413057148456573, 0.0064217327162623405, 0.09836794435977936, 0.3319624662399292, -0.44367653131484985, -0.2825829088687897, 0.5851542353630066, -0.46321114897727966, -0.38505232334136963, -0.6119499206542969, -0.25023338198661804, 0.2200530469417572, -0.40575870871543884, 0.031048385426402092, -0.24524925649166107, -0.47225263714790344, 0.09310261160135269, 0.17521490156650543, 0.5078087449073792, 0.2757122814655304, -0.4264339208602905, -0.2840862572193146, -0.7156739830970764, 0.09382157027721405, 0.6129948496818542, 0.06698315590620041, 0.3417603373527527, 0.30048924684524536, 0.11537846177816391, -1.2595304250717163, 0.5383166670799255, 0.1457369476556778, -0.5663045048713684, -0.4300360381603241, 0.4003426134586334, -0.8507755994796753, -0.4957040250301361, -0.7067357897758484, -0.03048574924468994, -0.31380900740623474, 0.47195473313331604, -0.09095151722431183, 0.2362247109413147, 0.2887464463710785, -0.10158311575651169, 0.05478034168481827, -0.5207127928733826, -0.28483837842941284, -0.04129645973443985, 0.6265032887458801, -0.250410795211792, 0.5042986869812012, 0.3387794494628906, 0.5264896750450134, 0.21413098275661469, -0.29381924867630005, 0.30822938680648804