{"title": "Student loan fixes that make sense", "doc_id": "616eb796-f0e8-11e3-bf76-447a5df6411f", "author": "Editorial Board", "annotation": "690-0", "published_date": "2014/06/15", "content_str": "IT\u2019S AN election year, and Democrats are loudly decrying the cost of higher education and demanding that the government spend more to cut student debt. The Senate on Wednesday rejected one of their less-sensible ideas. But there are better ones that lawmakers should embrace. The Senate halted a bill from Sen. Elizabeth Warren (D-Mass.) that would have allowed students with old government loans to refinance them. Instead of continuing to pay interest at, say, the 6.8 percent rate that prevailed for many years, they could take the 3.86 percent rate the government is offering current borrowers. Ms. Warren\u2019s plan had some appeal, and Democrats will no doubt harp on its rejection in the coming campaign. It seems only fair to let more debtors in on the deal that the government is offering current students. But those paying higher rates already got a good deal, taking loans out at rates and with terms that the private sector would never have matched. And the refinancing scheme would have been expensive, costing some $51 billion over 10 years, according to the Congressional Budget Office. Ms. Warren proposed to raise taxes on the wealthy by $72 billion, more than offsetting the cost. Yet if the government is to levy a large amount to make higher education affordable, lowering rates on old student loans is far from the best way. While he endorsed Ms. Warren\u2019s plan, President Obama also brought attention to a much worthier effort: fixing the government\u2019s income-based repayment system. Lowering rates widely doesn\u2019t target aid to the borrowers who need it most. Over time, many professionals can afford to pay higher interest rates to the government that helped them get valuable educations. Carefully adjusting graduates\u2019 monthly payments to their incomes would be a more progressive method. In a Monday executive order, Mr. Obama modestly expanded the existing pay-as-you-earn program, which caps monthly payments at 10\u2009percent of a borrower\u2019s income. The government forgives any remaining balance after 10 years for those in public service and after 20 years for everyone else. Congress could do much more. Lawmakers should consolidate the many federal income-based repayment programs into one simple deal for all debtors. They need to reduce the incentive for graduate students to take out excessive loans. And they need to make sure that those who deserve and receive debt forgiveness aren\u2019t taxed on the amount forgiven, since the IRS currently counts waived student loan balances as income. Another good idea is bolstering the Pell Grant program to offer year-round grants, so that students can study over the summer, or expanding access to the Pell program to more people. Read more on this from Opinions:  Greg Sargent: The Elizabeth Warren effect The Post\u2019s View: The billion-dollar risk hidden in the federal budget Atif Mian and Amir Sufi: Student borrowers assume too much risk", "default_text": [[" The Senate halted a bill from Sen. Elizabeth Warren (D-Mass.) that would have allowed students with old government loans to refinance them . Those paying higher rates already got a good deal, taking loans out at rates that the private sector would never have matched ."], [" Lowering rates widely doesn\u2019t target aid to the borrowers who need it most . Carefully adjusting graduates\u2019 monthly payments to their incomes would be a more progressive method . President Obama expanded the existing pay-as-you-earn program, which caps monthly payments at 10\u2009percent ."], [" Lawmakers should consolidate the many federal income-based repayment programs into one simple deal for all debtors . They need to reduce the incentive for graduate students to take out excessive loans . Those who deserve and receive debt forgiveness aren\u2019t taxed on the amount forgiven, since the IRS currently counts waived student loan balances as income ."]], "default_vector": [[0.3493800163269043, -0.9975398778915405, -0.49525922536849976, -0.013947547413408756, 0.10547927021980286, 0.2968749403953552, -0.715334415435791, -0.0654941126704216, -0.7676728963851929, 0.17151795327663422, 0.3067673146724701, 0.9587761759757996, 0.45210975408554077, 0.10503852367401123, -0.5303128957748413, -0.24738627672195435, 0.4596237242221832, -0.0905689001083374, 0.35605040192604065, 0.24075374007225037, -0.278550922870636, 0.4224933385848999, 0.5490161180496216, 0.24658873677253723, -0.2474818378686905, -0.018324565142393112, -0.14734743535518646, -0.13335053622722626, -0.5074789524078369, -0.35980895161628723, 0.620621383190155, -0.014686216600239277, 0.3135177493095398, 0.12938272953033447, 0.4686606824398041, 0.17229953408241272, 0.2699752748012543, -0.4991057515144348, -0.27829569578170776, -0.27585217356681824, 0.06253965944051743, 0.24908530712127686, 0.030186891555786133, 0.37738439440727234, -0.45522719621658325, 0.5796188116073608, 0.1189972385764122, -0.1136716976761818, -0.021264206618070602, -0.3359469175338745, 0.0423099584877491, 0.5201053023338318, 0.4002588093280792, -0.42901891469955444, 0.4382706582546234, -0.3222050368785858, -0.5675946474075317, -0.7702816128730774, 0.36644110083580017, -0.6617845296859741, 0.4200069308280945, -0.24836112558841705, 0.24716320633888245, 0.5488917827606201, -0.3261503279209137, -0.0793277770280838, 0.20591449737548828, -0.22603683173656464, -0.6031532883644104, -0.1909821629524231, 0.1339847892522812, -0.04835982993245125, 0.15318091213703156, 0.032127246260643005, 0.3020184636116028, -0.6664178967475891, 0.048096269369125366, -0.23779822885990143, 0.10230839997529984, -0.9884593486785889, 0.44815289974212646, 0.3366835415363312, -0.2034899741411209, 0.27440309524536133, -0.5498942136764526, -0.5083975791931152, -0.23714491724967957, -0.4317222833633423, -0.1474