{"title": "Bridging the job skills gap around the developing world", "doc_id": "27aaf870-f63e-11e3-a3a5-42be35962a52", "author": "", "annotation": "690-0", "published_date": "2014/06/17", "content_str": "Developing employment skills such as communication, relationship-building, and problem-solving is essential in helping millions of unemployed youth globally, according to a Washington, D.C.-based international development organization that works to help overcome challenges facing people in low- and middle-income countries. Through collaboration with more than 100 partner organizations, the Results for Development Institute (R4D) identifies and supports or implements new approaches to improving health, education and related areas including nutrition in low- and middle-income countries. \u201cWe\u2019re not on the pure academic end and we\u2019re not in the massive implementation; we\u2019re right in the middle deliberately,\u201d R4D managing director Nicholas Burnett said of what distinguishes his group\u2019s research and work from other Washington actors in the development space. It is estimated that by 2030, there will be 3.5 billion people in the global workforce, but 1 billion of whom will not have the necessary skills to find a job including 75 million youth, according to R4D. Unemployment is growing among youth. For example, in Kenya, 30 percent of 20-to-24-year-olds are unable to get jobs, according to information provided by R4D. A mismatch exists between the demands of the current global marketplace and the skills millions of young people have, Burnett said. \u201cIn the developing world, most people now get some secondary education, but most people don\u2019t even complete it,\u201d he said. \u201cSo secondary education is critically important in the developing world, because it\u2019s still incomplete but also because it\u2019s the level in which most people enter the workforce. It\u2019s true in Asia. It\u2019s true in Latin America.\u201d On Wednesday, the global nonprofit will host a panel discussion based on recently completed research that explores the skills gap and provides examples of programs in different countries aimed at promoting skills for employment through secondary education. The panel will consist of experts including representatives from the Toronto-based MasterCard Foundation, which promotes financial inclusion and advance youth learning, and Educate!, a U.S.- and Uganda-based non-governmental organization developing young leaders and entrepreneurs. Non-cognitive skills sometimes called soft skills or life skills, are largely behavioral \u2013 i.e. communicating well verbally and in writing, arriving to work on time, possessing a basic education. The skills are also considered flexible - they represent a \u201crange of skills that are crucially important not only in the modern U.S. economy, but actually around the world,\u201d Burnett said. David de Ferranti, co-founder and president of R4D, was once regional vice president for the World Bank in Latin America and the Caribbean. He spent several years working in development projects and had built up an extensive network of community-based organizations, thought leaders, and others concerned about how to effectively marry studying issues and problems with practical solutions. At the World Bank, he was responsible for a $25 billion loan portfolio and a staff of 700 in 16 locations. But believed there was more to be done. \u201cThe founder recognized a disconnect between the large multinational organizations operating in the developing world and the countries or the programs that they were trying to support,\u201d said Wambui Munge, communications officer. Large organizations had noble intentions and the infrastructure to carry projects, but found they had a hard time seeing the work on the ground, so to speak. And smaller organizations working on a micro-level found it hard to see their connection to the bigger picture, their role in making a large impact. R4D thinks of itself as a \u201cthink and do tank,\u201d Munge said. Its funding sources vary between multinational agencies and private foundations such as the World Bank, the Gates Foundation and the Rockefeller Foundation, which funded the skills research that will be presented Wednesday. They have a wide range of funders that vary across projects. Soft skills may be more crucial than analytical or job-specific skills, but curricula may not emphasize these skills. R4D\u2019s research focused on models or examples of innovation that seem to be working or seem to have promise such as entrepreneurship programs in public schools operated by Educate! and Yuwa, a program in India that uses soccer to teach girls the sport as well as other skills including how to get along, how to follow rules, and how to be flexible. Other bright spots, Burnett noted, have been employer-education collaborations that reformed middle-school curricula in Senegal or created targeted training programs and other vocational institutions through via a public private partnership in India known as the National Skills Development Corporation. Even though the focus on challenges and opportunities was primarily in Africa and Asia, key recommendations for training youth also are applicable in the United States, Burnett said. In the United States, the highest level of education attained by most unemployed adults 25 and older is less than a high school diploma. \u201cIn fact, according to IMF analysis, the skills gap accounts for approximately one-third of the U.S. unemployment rate. By 2020, an estimated 63 percent of the projected 48 million job openings will require some sort of post-secondary school training,\u201d according to a 2013 J.P. Morgan press release. \u201cThe problems are quite similar to those in the U.S.,\u201d Burnett said. \u201cThe solutions, while not identical, may be very important for the U.S. We think the techniques we\u2019ve been using to identify programs which are important could be applied here. We think that some of the program lessons could be applied here, of course, with appropriate adaptations.\u201d Related information: Link to R4D\u2019s recently published reports on Skills for Employment. Jeannine Hunter is a freelance writer living in Washington, D.C.", "default_text": [[" The Results for Development Institute (R4D) identifies and supports or implements new approaches to improving health, education and related areas including nutrition in low- and middle-income countries . It is estimated that by 2030, there will be 3.5 billion people in the global workforce, but 1 billion of whom will not have the skills to find a job ."], [" A mismatch exists between the demands of the global marketplace and the skills millions of young people have, R4D says . In Kenya, 30 percent of 20-to-24-year-olds are unable to get jobs, according to the nonprofit . The nonprofit will host a panel discussion based on recent research that explores the skills gap ."], [" Non-cognitive skills sometimes called soft skills or life skills are largely behavioral - i.e. communicating well verbally and in writing, arriving to work on time, possessing a basic education . They represent a \u201crange of skills that are crucially important not only in the modern U.S. economy, but actually around the world,\u201d Burnett said ."], [" The founder of R4D recognized a disconnect between large multinational organizations operating in the developing world and the countries or programs that they were trying to support . Large organizations had noble intentions and the infrastructure to carry projects, but found they had a hard time seeing the work on the ground, he says ."], [" R4D\u2019s research focused on models or examples of innovation that seem to be working or seem to have promise such as entrepreneurship programs in public schools operated by Educate! and Yuwa, a program in India that uses soccer to teach girls the sport as well as other skills ."], [" By 2020, an estimated 63 percent of the projected 48 million job openings will require some sort of post-secondary school training . \u201cThe solutions, while not identical, may be very important for the U.S.\u201d"]], "default_vector": [[0.43082666397094727, -0.013318425975739956, 0.18235152959823608, -0.037127863615751266, -0.5448184013366699, 0.4447402358055115, 0.42245882749557495, 0.11020178347826004, 0.05235954374074936, -0.567095160484314, 0.030054105445742607, 0.2783159017562866, 0.6718189120292664, 0.3701794743537903, -0.40750741958618164, 0.21491388976573944, 0.47070518136024475, -0.7272164821624756, 0.12641191482543945, -0.2748790383338928, -0.48006677627563477, 0.027612434700131416, -0.1662522554397583, 0.5245059132575989, 0.7878971099853516, 0.4610693156719208, 0.4055367410182953, -0.21762794256210327, 0.221798375248909, -1.015744686126709, 0.10382544994354248, -0.1656905710697174, -0.1471763253211975, 0.43664824962615967, -0.5252808332443237, -0.13180376589298248, -0.7567244172096252, -0.37114667892456055, -0.24333392083644867, -0.5068629384040833, -0.32585835456848145, -0.2505680024623871, -0.5617231130599976, 0.14406494796276093, -0.13505154848098755, 0.26688194274902344, -0.9233909845352173, 0.6258019208908081, 0.13407664000988007, -0.16843418776988983, 0.42697545886039734, -0.23632922768592834, -0.34097012877464294, -0.3093331754207611, -0.039559971541166306, 0.057857759296894073, 0.36374756693840027, -0.2552703320980072, 0.37177425622940063, 0.08509912341833115, 0.5282556414604187, 0.003961688838899136, 0.1856624335050583, -0.01808863691985607, 0.206044003367424, -0.5161962509155273, -0.36706438660621643, -0.7079933285713196, -0.1764269322156906, -0.44017457962036133, -0.6010852456092834, -0.1650674194097519, 0.4833405613899231, 0.9781628251075745, -0.6359716653823853, -0.6328880786895752, -0.7989683747291565, 0.6289966702461243, 0.03316802158951759, -0.5380823016166687, 0.3891840875148773, 0.3460988998413086, -0.10545117408037186, -0.5875970721