{"title": "MGM sets goals for National Harbor casino project\u2019s local hiring and contracting", "doc_id": "be30abe6-f639-11e3-8aa9-dad2ec039789", "author": "Luz Lazo", "annotation": "805-0", "published_date": "2014/06/17", "content_str": "MGM Resorts International and Prince George\u2019s County officials have reached an agreement that sets employment and procurement goals for the construction and operations of the $925\u00a0million casino resort planned for National Harbor. Some of the goals relate to the casino giant\u2019s hiring and contracting within the county and with companies owned by minorities. MGM also has committed to investing $1\u00a0million in the county before the casino opens and to contribute $400,000 to the county annually while the casino is in operation. For months, officials with the Prince George\u2019s county executive\u2019s office and MGM worked behind closed doors to negotiate the agreement. But that drew criticism from residents, civic leaders and County Council members who said they were being left out of the negotiations. County officials said Tuesday that they were pleased with the outcome of the negotiations and touted the agreement as a significant step toward ensuring that the Prince George\u2019s community gets its fair share from the project. \u201cWe have reached a deal with MGM that ensures this facility will have a transformative impact on our residents, businesses and communities,\u201d said County Executive Rushern L. Baker III (D). \u201cThe goals for local hiring and contracting in this agreement are both ambitious and fair.\u201d Those negotiated benefits, officials say, are in addition to the projected $40\u00a0million to $45\u00a0million the county is expected to receive annually from gaming revenue and through property and other taxes. The state also is anticipating substantial annual revenue from the casino, which is expected to generate $700\u00a0million or more annually by its third year. In December, Nevada-based MGM was awarded Maryland\u2019s sixth and final casino license. The company will build a luxurious casino on 23 acres overlooking the Potomac River. Plans call for the gambling resort to include 3,600 slot machines, 140 gaming tables, a glass-tower hotel with 300 suites, a concert theater, several celebrity-chef restaurants, a spa and high-end stores. As part of the deal, MGM has agreed to do its best to ensure that 40\u00a0percent of its workforce is from the county when the facility opens in July 2016. That amount would increase incrementally over five years to 50\u00a0percent. MGM says, however, that it aspires to have 50\u00a0percent be county residents on the first day. MGM also has committed to having 20\u00a0percent of its construction workforce be county residents. Under the agreement, at least 30\u00a0percent of construction contracting would go to businesses owned by minorities and at least 12\u00a0percent to minority businesses based in Prince George\u2019s. Bradley W. Frome, a top economic development aide to Baker, said the goals address residents\u2019 and county officials\u2019 worries that the project could exclude the local workforce, county and minority-owned firms as well as veterans. The agreement sets a compliance mechanism, including the creation of an oversight committee, to ensure that MGM meets the goals. If the committee determines that the company has failed to make \u201cbest efforts,\u201d MGM could be required to make additional charitable contributions to the county. But some residents remain concerned that the county\u2019s best interests were not represented during the negotiations. \u201cRight now, we have no idea what the community is going to get out of this project,\u201d said the Rev. Charles W. McNeill Jr., pastor of Unity Baptist Church in the District. The Fort Washington resident said the community wants to see MGM invest in social programs, community centers, and public safety and educational campaigns that could address any effects the gambling industry has on the county. \u201cWe want to make sure that there are investments in the infrastructure, that there is a community center the neighbors can use, that there is a relationship with the churches and funding for programs for people who may lose their homes or people who have alcohol problems,\u201d said McNeill, who is co-chairman of the Business and Clergy Partnership. Frome said the agreement ensures that 1,900 of the projected 3,800 jobs go to county residents and sets specific goals for contracts for county-based firms. A similar agreement made for the National Harbor project, for example, did not specifically differentiate between minority-owned businesses and minority-owned businesses based in Prince George\u2019s. \u201cWe looked at what is a number that is aggressive and that provides opportunities for county-based firms and residents,\u201d Frome said. MGM\u2019s commitment to invest $1\u00a0million in the county before the casino opens is said to help local nonprofit groups and the formation of a workforce. Half of the funds would be distributed among organizations providing workforce training, including Prince George\u2019s Community College, the University of Maryland at College Park and Bowie State University. About $250,000 would go to the Community Foundation for Prince George\u2019s County, which is an advocate for the county\u2019s nonprofits and handles other community funds, including the National Harbor Community Outreach Grant Fund. After the casino opens, MGM would continue to give $400,000 annually to the county through the Community Foundation and other organizations that benefit Prince George\u2019s. The company also plans to start a culinary program at Potomac High School in Oxon Hill, which would include the donation of kitchen equipment and teaching assistance. MGM also will have an internship program for students enrolled in county schools or who have at least one parent who is a county resident. The agreement does not include investments in transportation infrastructure to address traffic concerns around the 23-acre site. MGM is expected to file a separate transportation plan with the state. In addition, investments in the neighborhoods near the casino will come mostly through gaming revenue and could include $9\u00a0million for public safety and other local infrastructure, officials said. The County Council, which last month adopted legislation to ensure that the agreement was negotiated, is expected to review the deal and vote on it next month.", "default_text": [[" MGM Resorts International and Prince George\u2019s County officials have reached an agreement that sets employment and procurement goals for the construction and operations of the $925 million casino resort planned for National Harbor . Some of the goals relate to the casino giant's hiring and contracting within the county and with companies owned by minorities ."], [" Nevada-based MGM was awarded Maryland\u2019s sixth and final casino license in December . The company will build a luxurious casino on 23 acres overlooking the Potomac River . The state also is anticipating substantial annual revenue from the casino ."], [" MGM has agreed to do its best to ensure that 40 percent of its workforce is from the county when the facility opens in July 2016 . MGM says, however, that it aspires to have 50 percent be county residents on the first day ."], [" MGM could be required to make additional charitable contributions to the county . Some residents remain concerned that the county\u2019s best interests were not represented during negotiations . The Rev. Charles W. McNeill Jr. said the community wants to see MGM invest in social programs ."], [" MGM\u2019s commitment to invest $1 million in the county before the casino opens is said to help local nonprofit groups and the formation of a workforce . Half of the funds would be distributed among organizations providing workforce training, including the University of Maryland at College Park and Bowie State University ."], [" MGM plans to give $400,000 annually to the county through the Community Foundation and other organizations that benefit Prince George\u2019s . The company also plans to start a culinary program at Potomac High School in Oxon Hill, which would include the donation of kitchen equipment and teaching assistance ."]], "default_vector": [[0.11950723826885223, 0.8629286289215088, 0.32228919863700867, 0.3232351243495941, 0.23474936187267303, -0.31973475217819214, 0.36361050605773926, -0.9006229639053345, 0.694494366645813, -0.6234009265899658, -0.23759785294532776, 0.022684384137392044, 0.3794540464878082, 0.568135678768158, 0.31502458453178406, 0.47311317920684814, 0.0017585810273885727, -0.5787533521652222, 0.16456498205661774, -0.6003756523132324, -0.3045136630535126, -0.3081206977367401, -0.21995948255062103, 0.4514518678188324, 0.05248403921723366, -0.03310081362724304, 0.31440651416778564, -0.06622138619422913, -0.7213546633720398, -0.27405574917793274, 0.14265187084674835, -0.5543023943901062, -0.7412768006324768, 0.14043498039245605, -0.4178401827812195, 0.0633222758769989, 0.006106983404606581, -0.2670482397079468, -0.04593704640865326, -0.6386532187461853, 0.135310560464859, 0.7596310377120972, 0.575236976146698, -1.232588529586792, 0.5926312208175659, -0.5930918455123901, 0.12711362540721893, -0.22361329197883606, 0.7443833351135254, -0.27017995715141296, -0.38669490814208984, 0.16867311298847198, -0.31574246287345886, 0.14558415114879608, 0.48936042189598083, 0.19392134249210358, -0.24181970953941345, 0.15749692916870117, 0.17466683685779572, 0.15381762385368347, -0.23197442293167114, 0.26011723279953003, -0.2280670404434204, -0.17716430127620697, 0.17783212661743164, 0.373941034078598, 0.3552413284778595, -0.5177538394927979, -0.0604332834482193, -0.21862675249576569, 0.12287674844264984, 0.028865773230791092, 0.27316755056381226, 0.08612565696239471, 0.27541762590408325, 0.21529826521873474, 