, 0.5022097826004028, 0.8893399238586426, -0.3016495406627655, -0.14411094784736633, -0.6967143416404724, 0.15020403265953064, -0.5476743578910828, 0.3271157741546631, 0.4695066809654236, 0.1732361912727356, 0.07197347283363342, -0.3189740478992462, 0.4505474865436554, 0.3617357611656189, 0.28560149669647217, -0.5712080597877502, -0.593708872795105, 0.5313245058059692, 0.14741504192352295, -0.04015731066465378, 0.2561441659927368, -0.6679304242134094, -0.08970553427934647, -0.3813505470752716, 0.6600121855735779, 0.4712287187576294, -0.1980636864900589, 0.3076321482658386, 0.05225495621562004, 0.5849856734275818, 0.4344698190689087, 0.18993772566318512, 0.23386669158935547, 0.10288718342781067, -0.39216282963752747, -0.132770374417305, -0.3932769000530243, -0.2444661408662796, -0.13644732534885406, -0.07291969656944275, -0.3815494477748871, 0.7505815625190735, -0.33699938654899597, 0.7912539839744568, 0.2025981992483139, 0.5780754685401917, 0.13772477209568024, 0.2422170341014862, -0.03281068429350853, -0.07254056632518768, 1.1960140466690063, 0.43951863050460815, -0.3112993538379669, -0.07304071635007858, 0.5256918668746948, -0.15042820572853088, -0.09614133834838867, 0.15556961297988892, -0.47868144512176514, -0.20122680068016052, 0.22365811467170715, 0.32089072465896606, 0.20146280527114868, 0.1984976828098297, 0.5053896903991699, -0.5039325952529907, -0.15974336862564087, 0.5196423530578613]]}
{"title": "Starbucks chooses Arizona State to deliver online college courses for employees", "doc_id": "bb0608c6-f6e3-11e3-8aa9-dad2ec039789", "author": "Nick Anderson", "annotation": "690-0", "published_date": "2014/06/18", "content_str": "Like an extra shot of espresso in a cup of coffee, the announcement this week that Starbucks will spend millions of dollars to help its employees take online college courses at low cost or for free sent a jolt through the world of higher education. The Starbucks College Achievement Plan, as it\u2019s called, will provide partial scholarships for qualified employees who are freshmen and sophomores and full tuition reimbursement for those who are juniors and seniors. The idea is to give baristas and other employees a financial incentive to finish a college degree. There\u2019s a key condition: Participants will have to take classes online through Arizona State University. Your barista, then, might become a Sun Devil. Howard Schultz, chairman and chief executive of the Seattle-based company, said Wednesday in an interview with The Washington Post that he expects thousands of full- and part-time employees to take advantage of the benefit in the coming school year \u2014 perhaps as many as 10,000. The cost to Starbucks is difficult to project, but Schultz said it is \u201cvery possible\u201d that the company\u2019s share of the education cost could amount to $50 million a year. Under federal law, Starbucks can provide employees up to $5,250 a year for tuition reimbursement as a tax-free benefit. Students will be expected to obtain need-based financial aid from the federal government, if they qualify. Arizona State will provide grants as well. Notably, Starbucks is not requiring employees to stay with the company after they earn a degree. \u201cWe\u2019re investing in our people,\u201d Schultz said, \u201cand we should not put handcuffs on them.\u201d There is no shortage of colleges with online programs these days. Schultz said Starbucks considered teaming with several universities, including some run for profit, before settling on Arizona State. \u201cWe needed a like-minded university and a like-minded leader,\u201d he said, referring to Michael M. Crow, president of the university. Schultz said the company wanted only one partner at first because of the complexity of the initiative. Arizona State is one of the nation\u2019s largest universities and has grown rapidly in recent years. Crow said it has about 65,000 students enrolled in programs at the main campus in Tempe and others in the Phoenix area. Another 10,000, he said, are enrolled in online programs that began three years ago. The university has 40 online undergraduate degree programs, in subjects ranging from art history to electrical engineering. The Starbucks initiative could help double the university\u2019s online footprint. Crow, who is one of the nation\u2019s more ambitious university leaders, said Arizona State\u2019s online operation is of a scale comparable to those of Penn State University and the University of Maryland University College. Crow said he was pleased to collaborate with Starbucks on a program that aims to deliver \u201ca first-class college education.\u201d Arizona State, he said, \u201chas the vision, programs and scale to deliver it to Starbucks employees in every part of the country.\u201d", "default_text": [[" Starbucks will spend millions of dollars to help its employees take online college courses at low cost or for free . The idea is to give baristas and other employees a financial incentive to finish a college degree . Participants will have to take classes online through Arizona State University ."], [" Starbucks can provide employees up to $5,250 a year for tuition reimbursement as a tax-free benefit . Students will be expected to obtain need-based financial aid from the federal government . Starbucks is not requiring employees to stay with the company after they earn a degree ."], [" Arizona State is one of the nation\u2019s largest universities and has grown rapidly in recent years . Crow said it has about 65,000 students enrolled in programs at the main campus in Tempe and others in the Phoenix area . Another 10,000, he said, are enrolled in online programs that began three years ago ."]], "default_vector": [[0.0890442505478859, 0.7666664719581604, -0.3525106608867645, 0.5150494575500488, 0.2380540370941162, -0.11502677202224731, -0.188185915350914, 1.0609660148620605, 0.6416962146759033, 0.09092404693365097, 0.15032581984996796, -0.38895726203918457, 0.23041705787181854, -0.7486360669136047, -0.02839161641895771, -0.6786295175552368, -0.5551588535308838, 0.2338581085205078, -0.09492906928062439, -0.08899078518152237, -0.17291927337646484, 0.05330164358019829, 0.5563373565673828, -0.3331455588340759, 0.2986433506011963, 0.08286634832620621, 0.2606489062309265, 0.280936598777771, -0.590528666973114, 0.141267329454422, -0.02727379836142063, 0.3523651957511902, 0.21454136073589325, -0.4664747714996338, 0.15149123966693878, -0.3247967064380646, 0.05443467199802399, 0.14930382370948792, 0.6404542922973633, 0.08252166211605072, -0.057117853313684464, 0.8764592409133911, -0.1079673320055008, 0.20222800970077515, 0.034841544926166534, -0.9647117853164673, -0.5417132377624512, -0.010769592598080635, -0.30816248059272766, -0.47563114762306213, -0.2943953573703766, 0.21664920449256897, 0.8801428079605103, -0.1550164520740509, -0.5331517457962036, 0.3188855051994324, 0.127637580037117, -0.3179008364677429, -0.3735329806804657, 0.3510972559452057, -0.2588508725166321, 0.8168174028396606, -0.36483120918273926, -0.1779891550540924, 0.360614150762558, 0.2966272830963135, -0.661237895488739, 0.16133759915828705, -0.4483020305633545, -0.43266820907592773, 0.23151841759681702, -0.13514956831932068, -0.11980687826871872, 0.5890012383460999, -0.200903058052063, 0.2831979990005493, -0.2840064764022827, 0.41780930757522583, 0.24775497615337372, -0.21421833336353302, 0.025300910696