{"title": "At College World Series, very few runs, perhaps because of some errors", "doc_id": "daf6dfc6-f7f5-11e3-a3a5-42be35962a52", "author": "Mark Giannotto", "annotation": "690-0", "published_date": "2014/06/19", "content_str": "OMAHA \u2014 The first home run of the 2014 College World Series rocketed off the bat of Texas shortstop C.J. Hinojosa and didn\u2019t come to a stop until it ricocheted off the back of the left field bullpen at TD Ameritrade Park on Wednesday night. It had been 115 innings and more than 3,400 pitches since a player hit a ball out of the park in college baseball\u2019s championship event, and no one involved was quite sure how to react. \u201cFour players fainted,\u201d Texas Coach Augie Garrido joked after the Longhorns had emerged with a 1-0 victory over UC Irvine. \u201c.\u2009.\u2009. I had a mild heart attack.\u201d But the power outage is no laughing matter for those within college baseball. This year, the sport\u2019s marquee event has turned into a referendum on the lack of offense and the dearth of home runs in the college game. Ask three people here what the problem is and you get three different answers. Some say it\u2019s the bats, others claim it\u2019s the design of Omaha\u2019s new downtown stadium and the NCAA thinks it could be the structure of the balls being used. Regardless, teams are averaging a combined 5.5 runs per game at this year\u2019s College World Series , well below the previous nadir of 6.2 runs set just last year. Attendance is also down about 2,000 fans per game during this year\u2019s event, and there are concerns over how many others are tuning out nationwide. \u201cWhen you talk to coaches who\u2019ve been around the game a long time and been to Omaha many times, many of them, they\u2019re not even watching the games anymore. They think it\u2019s boring,\u201d Baseball America\u2019s Aaron Fitt said. \u201cIf those guys that love baseball \u2014 that eat, sleep and breathe baseball \u2014 if it\u2019s boring to them, what\u2019s it going to be like for the normal baseball fan? \u201cYou shouldn\u2019t have to be Babe Ruth to hit a home run.\u201d Scoring has decreased throughout the college baseball regular season since the NCAA, out of concern for safety, instituted less-potent BBCOR-standard metal bats \u2014 it stands for Bat-Ball Coefficient of Restitution \u2014 in 2011 that more closely simulate the effect of wooden bats used in Major League Baseball. But the most drastic effects have been seen at the College World Series, where a steady stream of sacrifice bunts are now the norm. \u201cWe went too far the other way. Everybody knows that, and everybody agrees with that,\u201d said UC Irvine Coach Mike Gillespie, who was at Southern California when it won the 1998 College World Series with a 21-14 win over Arizona State. \u201cNow we\u2019re stuck with it because the manufacturers have made these bats and they have a large inventory. It\u2019s a nightmare.\u201d Another variable has been the construction of TD Ameritrade Park, whose opening coincided with the deadened bats. Though its dimensions are nearly the same as the event\u2019s previous home, Rosenblatt Stadium, the orientation changed to provide fans a view of Omaha\u2019s downtown skyline. The new stadium faces southeast, and on most June nights, the summer wind off the Missouri River, with gusts of up to 30 mph this year, blows in from right field or directly toward home plate. There were 32 home runs hit during the 2010 College World Series, the final year it was held at Rosenblatt. Just 24 have been hit in the three-plus years since the event moved to TD Ameritrade Park. Teams also play their outfielders closer to the infield than during the regular season, a strategy that often turns line drives into routine outs. TCU Coach Jim Schlossnagle said it\u2019s \u201ca travesty what we\u2019ve done to college baseball\u201d after Virginia defeated his Horned Frogs, 3-2, in a 15-inning marathon Tuesday night. Even Virginia Coach Brian O\u2019Connor, who has benefited from the field conditions this year with a pitching staff that ranks among the top five in the country, is concerned. \u201cThe game is just so different than what we\u2019re used to in the regular season,\u201d O\u2019Connor said. The Cavaliers face either Mississippi on Friday night needing just one win to reach the championship series. HDR Architecture Inc. senior vice president Bruce Carpenter, part of the team that designed TD Ameritrade Park, said plans were drawn up back in 2008 and \u201cthere wasn\u2019t really any discussion in our design meetings about changing the bat.\u201d He noted pulling in the outfield fences would come at a \u201csignificant cost\u201d at this point and altering equipment is likely the best option to increase offense going forward. To that end, the NCAA will adopt a new baseball with lowered seams beginning next season. The organization\u2019s research suggests the ball will travel up to 20 percent further with less drag and it will take some of the bite off a pitcher\u2019s breaking ball. If that doesn\u2019t work, they also could change the core of the ball, which is softer than those used in the minor leagues and MLB. \u201cWe don\u2019t have our head in the sand on this,\u201d said Damani Leech, the NCAA\u2019s managing director for championships and alliances. \u201cWe hope [new baseballs] will have an impact, and if it doesn\u2019t, we\u2019ll talk about other things.\u201d But until any changes result in more home runs and scoring, those within the sport will remain skeptical. \u201cI just wish they had used more foresight when they dramatically altered the way the game is played,\u201d Fitt said. \u201cThey just didn\u2019t think it through enough.\u201d", "default_text": [[" It had been 115 innings and more than 3,400 pitches since a player hit a ball out of the park in college baseball\u2019s championship event . \u201cFour players fainted,\u201d Texas Coach Augie Garrido joked after the Longhorns beat UC Irvine 1-0 . This year's marquee event has turned into a referendum on the lack of offense and the dearth of home runs in the college game ."], [" Teams are averaging a combined 5.5 runs per game at this year\u2019s College World Series . Scoring has decreased throughout the college baseball regular season since the NCAA instituted less-potent metal bats in 2011 ."], [" A steady stream of sacrifice bunts are now the norm at the College World Series . TD Ameritrade Park's opening coincided with the deadened bats . The new stadium faces southeast, and on most June nights, the summer wind off the Missouri River blows in from right field ."], [" Just 24 have been hit in the three-plus years since the event moved to TD Ameritrade Park . TCU Coach Jim Schlossnagle said it\u2019s \u201ca travesty what we\u2019ve done to college baseball\u201d Virginia defeated TCU 3-2 in a 15-inning marathon Tuesday night ."], [" The NCAA will adopt a new baseball with lowered seams beginning next season . Research suggests the ball will travel up to 20 percent further with less drag . If that doesn't work, they also could change the core of the ball, which is softer ."], [" \u201cThey just didn\u2019t think it through enough. ly altered the way the game is played,\u201d Fitt said ."]], "default_vector": [[-0.320556104183197, -0.4143724739551544, -0.37940549850463867, -0.0820048600435257, -0.5449731945991516, -0.3434719443321228, -0.3896827697753906, 1.034500002861023, 0.32450810074806213, 0.3186304271221161, -0.08314646035432816, -0.6576342582702637, -0.024704106152057648, 0.2576471269130707, 0.010979145765304565, 0.25706973671913147, -0.28019705414772034, -0.4316837787628174, 0.16672055423259735, -0.20728902518749237, 0.30638793110847473, 0.17308732867240906, -0.30578377842903137, -0.13470172882080078, 0.010309302248060703, -0.08435112982988358, -0.29504236578941345, 0.38647323846817017, 0.1764715164899826, -0.09656351059675217, -0.25867