{"title": "One fish, three meals: Paul Greenberg makes the case for Americans to get hip to seafood", "doc_id": "81621532-f725-11e3-a3a5-42be35962a52", "author": "Jane Black", "annotation": "805-0", "published_date": "2014/06/20", "content_str": " Author Paul Greenberg was standing in his Manhattan kitchen, cleaver in hand. He had already fluidly removed two fillets from a gleaming red snapper, shipped overnight from the Gulf of Mexico. Now it was time to take off the head, which he would use to make a spicy Korean soup. \u201cThis,\u201d he said with a laugh, \u201cis where it gets gnarly.\u201d Then with a swift chop he severed the fish\u2019s head from its body. It would have been easier to buy a few fillets or, for this dish, to ask a fishmonger for the head. (Sometimes they\u2019ll give it to you free.) But Greenberg, best-selling author of \u201cFour Fish: The Future of the Last Wild Food,\u201d wanted to make use of a whole snapper in service of a larger point: Americans need to eat more American seafood. It\u2019s a point he makes compellingly clear in his new book, \u201cAmerican Catch: The Fight for our Local Seafood\u201d (Penguin Press, June 2014). The United States controls more ocean than any other country on Earth. Yet despite our 2.8 billion acres of ocean, 94,000 miles of coast and 3.5 million miles of rivers, 91 percent of the seafood Americans eat is imported. It gets fishier, Greenberg says. Much of what we import is farmed; shrimp and tilapia top the list. Meanwhile, one-third of what we catch is sent overseas. \u201cThere are of course subtleties to the ridiculous international fish swap we\u2019re engaged in here in America, but after three years of pounding my head against the data, what I realized is that we\u2019re basically low-grading our seafood supply,\u201d Greenberg said. \u201cWe\u2019re sending the good wild American stuff that makes you heart healthy and smart to Asia and importing all this farmed stuff from Asia that doesn\u2019t really do too much for you from a health perspective.\u201d Moreover, American fisheries are some of the best managed in the world. After changes to fishery law in 2006, more U.S. fisheries than ever are making efforts to end overfishing, limit bycatch and more, said\u00a0Margaret Spring, vice president of conservation and science at the Monterey Bay Aquarium. Now, just 3 percent of them carry the red (\u201cavoid\u201d) label in the aquarium\u2019s Seafood Watch program. \u201cThe United States has emerged as a global leader,\u201d she said in an e-mail.\u00a0 There are many reasons why Americans don\u2019t cook more seafood, domestic or imported. One of the biggest is that we are scared of fish. According to Greenberg\u2019s sources in the seafood industry, surveys show that Americans tend to have three complaints about fish: \u201cOne, I don\u2019t want to touch it. Two, I don\u2019t know how to cook it. And three, I don\u2019t want it smelling up my kitchen,\u201d he said. That\u2019s why so much of the fish America imports, such as tilapia, is odorless and all but tasteless: \u201ca fried-dough delivery system,\u201d Greenberg calls it. It\u2019s also a lot cheaper. Wild boneless red snapper fillets, for example, cost $20 to $30 a pound. Imported tilapia, by comparison, maxes out at $10 a pound. And so dressed in shorts, a green buttoned-down and a well-worn apron, Greenberg, 46, set out to show me that cooking fish need not be scary or super expensive. He started with a whole fish, which cut the cost considerably; a whole wild snapper at Whole Foods costs $11.99 a pound. By using almost everything, Greenberg would make three meals for four from a single 5-pound fish, bringing the cost of the snapper to less than $5 a serving. For the recipes, he chose a trio of Asian dishes from Vietnam, Korea and China, countries that buy and eat much of America\u2019s wild fish. Greenberg grew up in Greenwich, Conn. He learned to fish during what he calls \u201cdivorced dad fishing weekends,\u201d and it soon became a consuming passion. Greenberg got his first boat when he was 13. At 16, he sold his first piece of journalism, a how-to on catching Martha\u2019s Vineyard bonito, to a magazine called the New England Fisherman. Though he is now revered as a guru on seafood and sustainability, Greenberg admits he wasn\u2019t always thoughtful about how he fished or how much he caught. There weren\u2019t a lot of rules back in the 1970s, he remembers, \u201cand when the fish were biting, it was hard to stop.\u201d Writing \u201cFour Fish\u201d and then \u201cAmerican Catch\u201d changed the way he thought about fishing \u2014 and cooking fish at home. \u201cAfter \u2018Four Fish,\u2019 the question I always got from people was, \u2018How can you fish when you know fish are in such trouble?\u2019\u201d he said. \u201cAt that point, I think even I thought of fisheries as something that someone else was supposed to manage. I realized that I needed to be more mindful, too.\u201d Which brings us back to the fish head. In America, we usually just throw it away. Indeed, according to the UN Food and Agriculture Organization, Americans waste about 30 percent of the seafood they buy. But there is plenty of good meat in and around the head. Using a small paring knife and his fingers, Greenberg removed chunks of flesh from what\u2019s known as the collar, or throat, and, after a few minutes in simmering water, the snapper\u2019s cheeks as well. He also strummed his fingers along the bones (also called a rack) to remove any shreds of meat left behind after the fillets were removed. All told, he was able to salvage 6 ounces of meat, plenty for his Korean fish head soup. \u201cI think of it as an honor to the fish,\u201d Greenberg says. \u201cIf you are going to kill it, you should eat it all.\u201d The whole thing \u2014 once I got past the yuck factor \u2014 was a cinch. Into a large pot went the fish head and the rack and enough water to cover. After it had simmered for 10 minutes, Greenberg strained the liquid and added his vegetables and two kinds of Korean chilies, a powder called gochukaru and the spicy paste gochujang, made from chilies and fermented soybeans. Just before the stew came off the stove, Greenberg added the reserved fish meat. The result was a light but hearty broth that was magically refreshing and satisfying at the same time. That left us with two fillets. With the first, Greenberg decided to make one of his favorite Vietnamese recipes, Cha Ca Thang Long, chunks of fried fish wrapped in lettuce with an array of sweet and spicy condiments. It was a bit of an odd choice for a super-fresh fillet, which you might think to steam or serve as seviche. But Greenberg had his reasons. \u201cIf you\u2019re new to filleting fish, you may not end up with a perfect fillet,\u201d he said. That is a plus, but it\u2019s hardly the only one. The dish is fresh (thanks, dill and mint), crunchy (ditto, peanuts), bright, sweet \u2014 and plenty spicy, if that\u2019s how you like it. But Greenberg also loves the lettuce wraps because this is what he calls a \u201cstone soup\u201d recipe. You can use whatever you like in the dish (or whatever you have on hand): sesame seeds, basil, cucumber, even tomatoes. \u201cThat\u2019s the nice thing about being American,\u201d he says. \u201cThere aren\u2019t a lot of rules. You can do what you want.\u201d For the second fillet, Greenberg wanted a recipe with strong flavors \u2014 flavors that could mask any fishiness after a few days in the fridge. Just the word \u201cfishy\u201d is enough to make me blanch. If a fish smells, shouldn\u2019t you throw it away? \u201cA little fishiness is normal and fine\u201d if a fish isn\u2019t right out of the water, says Greenberg. \u201cThat\u2019s why every cuisine has a way of dealing with it.\u201d For the Chinese, two go-tos are ginger and vinegar. They combined beautifully with mushrooms and ground pork in a classic Beijing dish that Greenberg describes as what perfect Chinese takeout would taste like if takeout were perfect. He cut the fish into chunks, marinated them with ginger, sugar, sherry and egg, then coated them in cornstarch. Then he fried them in a wok until they were a gorgeous golden brown. Next, he stir-fried the pork and mushrooms with more ginger, garlic and scallions. From start to finish, the whole dish took 30 minutes. Greenberg had at least one convert: me. Working with a whole fish made culinary and economic sense. But, I asked him, couldn\u2019t I just buy a whole fish and ask the fishmonger to fillet it (at no extra charge) and give me the head, even the rack? You could, he admitted. But it was clear Greenberg thought that would ruin some of the fun. \u201cAs one fisherman told me recently, \u2018Americans aren\u2019t hip to fish,\u2019\u200a\u201d he said. \u201cWe should be.\u201d Black is a former Food section staffer based in Brooklyn. On Twitter: @jane_black. Paul Greenberg will read from \u201cAmerican Catch\u201d at Politics and Prose on July 15 at 7 p.m.  Recipes: Fish Fillets in Spicy Vinegar Sauce, Beijing Style Hanoi-Style Fried Fish With Turmeric and Dill (Cha Ca Thang Long) Korean Spicy Fish Stew (Mae Un Tang) More from Food: Fish in the slow cooker goes swimmingly   Want a healthful weeknight meal? Cook fish. Fish strategies and recipes: How to land more seafood on your table.", "default_text": [[" Paul Greenberg: Americans need to eat more American seafood . He says the U.S. controls more ocean than any other country on Earth . Despite our 2.8 billion acres of ocean, 94,000 miles of coast and 3.5 mi of coast, we still have oceans . Greenberg's new book, \"American Catch: The Fight for our Local Seafood,\" is out now ."], [" 91 percent of the seafood Americans eat is imported . Much of what we import is farmed; shrimp and tilapia top the list . American fisheries are some of the best managed in the world ."], [" There are many reasons why Americans don\u2019t cook more seafood, domestic or imported . One of the biggest is that we are scared of fish . So much of the fish America imports, such as tilapia, is odorless and all but tasteless ."], [" Greenberg grew up in Greenwich, Conn. He learned to fish during what he calls \u201cdivorced dad fishing weekends . He got his first boat when he was 13, sold his first piece of journalism, a how-to on catching Martha\u2019s Vineyard bonito, to a magazine called the New England Fisherman ."], [" In America, we usually just throw it away. But there is plenty of good meat in and around the head . According to the UN Food and Agriculture Organization, Americans waste about 30 percent of seafood ."], [" Korean fish head soup was a cinch once you got past the yuck factor . It was a light but hearty broth that was magically refreshing and satisfying at the same time ."], [" The dish is fresh (thanks, dill and mint), crunchy (ditto, peanuts) bright, sweet and plenty spicy . Greenberg also loves the lettuce wraps because this is a \u201cstone soup\u201d recipe . You can use whatever you like in the dish (or whatever you have on hand)"], [" A whole fish marinated with ginger, sugar, sherry and egg, coated with cornstarch . Then fried them in a wok until they were a gorgeous golden brown . Next, stir-fried the pork and mushrooms with more ginger, garlic and scallions ."], [" Paul Greenberg will read from \u201cAmerican Catch\u201d at Politics and Prose on July 15 at 7 p.m. n Brooklyn ."]], "default_vector": [[-0.4491865038871765, -0.0507996529340744, -0.23291197419166565, 0.17734897136688232, 0.2505379319190979, -0.1826339066028595, -0.5060977339744568, 0.6626267433166504, -0.7134632468223572, 0.10007604211568832, 0.3345317542552948, 0.1980762928724289, 0.6402578949928284, -0.29449009895324707, 0.5379437804222107, 0.2805282473564148, 0.1554560661315918, -0.321547269821167, -0.36219245195388794, 0.14091436564922333, -0.11300840228796005, 0.14694766700267792, 0.6981626749038696, -0.0475229471