{"title": "How to fillet a whole fish", "doc_id": "991ee5a4-f72c-11e3-a3a5-42be35962a52", "author": "", "annotation": "805-0", "published_date": "2014/06/24", "content_str": "Filleting a whole (gutted) fish is not hard, though it does take practice. Here\u2019s what to do, from New York author and fish expert Paul Greenberg.  Note: If you are skinning the fillets, do it with a knife that\u2019s duller than a filleting knife. To remove the skin as easily as possible, you don\u2019t want the blade to cut through it as you work. \u00a0Lay the fish on a cutting board with the dorsal fins facing you. (The fish should be scaled if you plan to eat the skin, unscaled if you\u2019re going to skin the fillet.) Use a thin, flexible, sharp knife to make an incision parallel to, and slightly behind, the fish\u2019s collar bone, keeping the head attached. \u00a0Starting at the top (dorsal) end of the first cut, make another incision perpendicular to the collar, along the spine, cutting through the skin from head to tail. Run the blade as close to the ribs as you can, gradually freeing the flesh from the rack (bones/skeleton in the body). If you are where you should be, you\u2019ll hear a washboard sound as the blade runs along the bones. An expert can remove the fillet in one or two cuts. It may take half a dozen for a first-timer. \u00a0Once the fillet is nearly free of the bones, cut through the belly skin; transfer the fillet to a plate. Turn over the fish and repeat with the remaining fillet. (This will be harder to remove than the first side because the fish is no longer lying flat, and also because right-handed and left-handed cooks always have a dominant side that works better. Don\u2019t be too hard on yourself if the second fillet doesn\u2019t look as good or if you leave some flesh on the bone.) \u00a0To skin the fillet, lay it flesh side up on the cutting board. Use a somewhat duller knife to cut a nick about 1 inch from the tail end, then insert the knife at a 45-degree angle. Holding tight to the tail end of the fillet, slide the knife blade under the fillet. Move the skin back and forth until the fillet is released. \u2014 J.B.  Recipes: Fish Fillets in Spicy Vinegar Sauce Beijing Style Hanoi-Style Fried Fish With Turmeric and Dill (Cha Ca Thang Long) Korean Spicy Fish Stew (Mae Un Tang) More from Food: One fish, three meals: Paul Greenberg makes the case for Americans to get hip to seafood", "default_text": [[" Filleting a whole (gutted) fish is not hard, though it does take practice . Lay the fish on a cutting board with the dorsal fins facing you . Use a thin, flexible, sharp knife to make an incision parallel to, and slightly behind, the fish\u2019s collar bone ."], [" An expert can remove the fillet in one or two cuts . It may take half a dozen for a first-timer . To skin the fish, lay it flesh side up on the cutting board ."], [" Korean Spicy Fish Stew (Mae Un Tang)"]], "default_vector": [[0.5260955095291138, -0.4960010349750519, -0.8241926431655884, 0.08333172649145126, -0.26103025674819946, 0.436860054731369, -0.8448324799537659, -0.4777354300022125, 0.1514829695224762, -0.2849562466144562, 0.3521072566509247, 0.3126952350139618, 0.5175392627716064, -0.6458260416984558, 0.5779386162757874, 0.6298603415489197, 0.017666993662714958, -0.5870369076728821, -0.15562081336975098, 0.11664130538702011, -0.3503529131412506, -0.08559002727270126, 0.02172628603875637, 0.5955616235733032, 0.37533488869667053, 0.073488749563694, 0.2033538669347763, 0.22373057901859283, 0.7850160598754883, 0.22918067872524261, 0.14676369726657867, -0.3239797055721283, 0.48217102885246277, 0.14720281958580017, -0.11081459373235703, -0.047560933977365494, 0.27243855595588684, 0.8219088912010193, 0.05591562017798424, -0.07297437638044357, -0.7364140748977661, 0.8500699400901794, -0.10177607089281082, 0.03850525990128517, 0.5159921646118164, 0.5432378053665161, 0.49886438250541687, -0.18989326059818268, -0.27044910192489624, 0.27384132146835327, 0.072615