{"title": "Maybe college isn\u2019t for everyone. But it\u2019s probably for you.", "doc_id": "fd7104820c4a36c5d726ebeb898135c4", "author": "Dylan Matthews", "annotation": "690-1", "published_date": "2013/05/10", "content_str": "Stephanie Owen's and Isabel Sawhill's Brookings report, \"Should Everyone Go to College?\" is getting a great deal of well-deserved attention. But some of the coverage misses the report's main implication. The Wall Street Journal opened their article, \"Even in a weak job market, the old college try isn\u2019t the answer for everyone.\" The LA Times' headline was, \"College is a bad financial bet for some, study says.\" The study does say that, and is framed by its authors as casting doubt on the assumption that everyone should go to college. But the most interesting part of it is that it shows that the majority of people should. Indeed, the report is more of a testament to the poor quality of some colleges and universities than to the inappropriateness of college for a large number of students. Let's back up. What's at issue in the Owen-Sawhill report is the \"return on investment\" (ROI) to college. That's the amount of money one can expect to get, having gone to college, in excess of what they would have gotten had they not gone at all. Generally speaking, the annual ROI for college is enormous. Michael Greenstone and Adam Looney at the Hamilton Project calculate that it's stayed at around 16 percent for the past few decades: And that's not including financial aid. Once you factor the increase in that in recent decades into the equation, the ROI has actually grown. And compared to the return on stocks (around 6.8 percent), corporate bonds (2.9 percent), gold (2.3 percent), long-term government bonds (2.2 percent) and housing (0.4 percent), it's really, really high: But Owen and Sawhill point out that these are just averages. What happens when you break down the ROI by college major? Unsurprisingly, engineering, computer science, and math majors see their life earnings increase, and humanities majors see it fall relative to the average: And more selective institutions have a higher ROI than less selective ones: Pretty damning, right? No! Check the majors chart again. Note that every single one of those majors reports higher lifetime earnings than the average high school graduate. It may be the case that some schools are expensive enough that the gains to, say, a low-earnings education degree aren't worth the tuition, and the ROI is thus negative. But there isn't a major that reduces lifetime earnings relative to earnings without college. Meanwhile, the school category with the lowest ROI, noncompetitive private schools, still has returns of about 6 percent. Worse than the stock market, sure, but still better than just about any other investment you can think of. The most bracing part of the report is that it notes up to 200 schools with actually negative returns on investment for their degrees. The Savannah College of Art and Design (SCAD) and Judson University are at the bottom of the list, costing their graduates about $160,000 relative to if they hadn't gone to college. You can see the full list at PayScale's Web site here. Those schools really aren't any good as investments, though they may well make for a fun four years, if you're willing to spend $160,000 on that sort of thing. And a caveat is in order that ROI as used above doesn't adjust for graduation rates. These are the returns for those who go and graduate, not the (many) who drop out midway through. Then again, in 2011 PayScale accounted for that, and actually didn't find any schools with negative ROIs. SCAD even had a positive one. That casts some doubt on the reliability of the data being used to make these judgments, if they change that dramatically from 2011 to 2013, but it also suggests that the graduation rate issue doesn't change the overall story. All told, the case for college triumphalism remains much stronger than the case for skepticism. Even marginal students on the border between attending and not attending tend to benefit from college. Seth Zimmerman, a PhD student at Yale, compared the earnings of Florida students whose GPAs were just above and just below the Florida State University system's cutoff. There's a huge effect of being just above the cutoff (3.0, for most students), suggesting that students at the margin still gain substantially from college. Owen and Sawhill's report is important and worth taking seriously, but trying to make it into a case against college is wrongheaded. College really does come with additional earnings, and no research to date has persuasively refuted that as a general point.", "default_text": [[" Brookings report, \"Should Everyone Go to College?\" is getting a great deal of well-deserved attention . The report is more of a testament to the poor quality of some colleges and universities than to the inappropriateness of college for a large number of students . The most interesting part of it is that it shows that the majority of people should go to college ."], [" The annual ROI for college has stayed at around 16 percent for the past few decades . But that's not including financial aid, it's actually grown . Engineering, computer science, math majors see their earnings rise relative to the average ."], [" Up to 200 schools with negative returns on investment for their degrees . Savannah College of Art and Design (SCAD) and Judson University are at the bottom of the list . The school category with the lowest ROI, noncompetitive private schools, has returns of about 6 percent ."], [" ROI as used above doesn't adjust for graduation rates . In 2011 PayScale found no schools with negative ROIs . SCAD even had a positive one ."], [" Owen and Sawhill's report is important and worth taking seriously, but trying to make it into a case against college is wrongheaded . College really does come with additional earnings, and no research to date has persuasively refuted that as a general point ."]], "default_vector": [[0.03883833438158035, 0.04105580598115921, 0.24887509644031525, 0.2944425940513611, -0.2712751626968384, -0.3897867202758789, -0.21790392696857452, 1.2365739345550537, -0.1475890725851059, 0.33862605690956116, 0.03233816474676132, 0.17200230062007904, -0.3897364139556885, -0.07567094266414642, 0.1299404352903366, -0.4627849757671356, 0.5656452775001526, -0.033002302050590515, 0.381165474653244, -0.07487494498491287, 0.3214263617992401, 0.3327796161174774, 0.201791912317276, -0.4448864161968231, 0.7343065142631531, -0.048422519117593765, 0.17489539086818695, -0.7605496644973755, 0.05321025848388672, -0.21430227160453796, -0.03938325494527817, 0.8318086862564087, 0.16868601739406586, 0.3272339999675751, -0.6539962887763977, -0.3536189794540405, 0.0678110346198082, 0.19665639102458954, 0.9783647656440735, 0.47467148303985596, 0.013170151039958, -0.08171398937702179, -0.5035467743873596, 0.53336501121521, -0.324812650680542, -0.056415263563394547, 0.13580532371997833, 0.3509562611579895, -0.6023555994033813, -0.746425449848175, 0.022594792768359184, -0.1570541113615036, -0.03576039522886276, 0.27842459082603455, -0.17394928634166718, -0.8447242379188538, 0.2766534686088562, -0.780936598777771, -0.046763885766267776, -0.08223722875118256, 0.2743556797504425, 0.18422508239746094, -0.22310800850391388, 0.34969910979270935, 0.34090298414230347, 0.6678072214126587, -0.8253484964370728, -0.29918619990348816, -0.3187907338142395, 0.41278597712516785, -0.2292371690273285, 0.16733382642269135, 0.1336325854063034, 0.06274887174367905, -0.5517277717590332, 0.5579491853713989, 0.11769010126590729, 0.1889967918395996, 0.15372151136398315, -0.34583768248558044, 0.27673017978668213, 0.3709847629070282, 0.4329070448875427, 0.20224396884441376, -0.02636457420885563, -0.462859183549881, 0.48470932245254517, 0.08278992027044296, 0.4387201964855194, 0.3534841537475586, 0.27734026312828064, -0.1923086941242218, -0.10215083509683609, -0