{"title": "Hispanic high school graduates pass whites in college enrollment rate", "doc_id": "dbdeef4673be59585c03771593a6e969", "author": "Valerie Strauss", "annotation": "690-0", "published_date": "2013/05/11", "content_str": " resigned for suggesting Pew Research Hispanic Center released In a report by Richard Fry and Paul Taylor, the center says that \u201ca record seven-in-ten (69%) Hispanic high school graduates in the class of 2012 enrolled in college that fall, two percentage points higher than the rate (67%) among their white counterparts.\u201d Furthermore, the center\u2019s analysis of new data from the U.S. Census Bureau showed that according to the most recent available data, in 2011, \u201conly 14% of Hispanic 16- to 24-year-olds were high school dropouts, half the level in 2000 (28%).\u201d A recent comprehensive investigation of high school graduation rates finds that 78% of Hispanics graduated from high school in 2010, an increase from 64% in 2000. The high school dropout rate among whites\u00a0 also declined during that period \u2014 from 7 percent in 2000 to 5 percent in 2011, but not as much as the Hispanic rate.  Recent high school completers are only a subset of youth. Some youth recently dropped out of high school, others dropped out in earlier years, and some were never enrolled in U.S. schools. The immediate college entry rate only refers to youth recently graduating high school. Furthermore, it is possible that a youth could delay attending college after being out of high school for some time\u2026. \u2026.Young Hispanic college students are less likely than their white counterparts to enroll in a four-year college (56% versus 72%), they are less likely to attend a selective college, less likely to be enrolled in college full time, and less likely to complete a bachelor\u2019s degree. \u00a0 The Hispanic college enrollment rise is a trend that accelerated with the onset of the recession in 2008, the report says. As recently as the high school graduating class of 2000, only 49 percent of Hispanics immediately enrolled in college the following fall. The authors suggest these as possible causes for the rise in Hispanic college enrollment: It is possible that the rise in high school completion and college enrollment by Latino youths has been driven, at least in part, by their declining fortunes in the job market. Since the onset of the recession at the end of 2007, unemployment among Latinos ages 16 to 24 has gone up by seven percentage points, compared with a five percentage point rise among white youths. With jobs harder to find, more Latino youths may have chosen to stay in school longer. Another factor, however, could be the importance that Latino families place on a college education. According to a 2009 Pew Hispanic Center survey, 88% of Latinos ages 16 and older agreed that a college degree is necessary to get ahead in life today (Pew Hispanic Center, 2009). By contrast, a separate 2009 survey of all Americans ages 16 and older found that fewer (74%) said the same (Pew Research Social & Demographic Trends, 2009). In October 2012, 66 percent of all recent high school graduates were enrolled in college, the report says. You can read about the resignation of Jason Richwine, from the Heritage Foundation here. The co-author of a controversial Heritage study that has invited an avalanche of blistering criticism, has resigned from Heritage, the first step in what will be an effort to contain the damage arising from the report. \u00a0", "default_text": [[" A record seven-in-ten (69%) Hispanic high school graduates in the class of 2012 enrolled in college . The high school dropout rate among whites also declined during that period . In 2011, only 14% of Hispanic 16- to 24-year-olds were high-school dropouts ."], [" Hispanic college enrollment rise is a trend that accelerated with the onset of the recession in 2008, the report says . Young Hispanic college students are less likely than their white counterparts to enroll in a four-year college (56% versus 72%) and less likely to complete a bachelor\u2019s degree ."], [" Unemployment among Latinos ages 16 to 24 has gone up by seven percentage points, compared with a five percentage point rise among white youths . With jobs harder to find, more Latino youths may have chosen to stay in school longer . In October 2012, 66 percent of recent high school graduates were enrolled in college, report says ."], [" Heritage has resigned from Heritage, the first step in what will be an effort to contain the damage arising from the report . Heritage has been hit by an avalanche of blistering criticism ."]], "default_vector": [[-0.4596470296382904, 0.16827066242694855, -0.13856405019760132, 0.19711965322494507, 0.40581968426704407, 0.3128620386123657, -0.08371452987194061, 1.1055889129638672, -0.10115373134613037, 0.7902950644493103, -0.4672927260398865, -0.37118861079216003, 0.20422466099262238, -0.13293547928333282, -0.3429635167121887, -0.5474370121955872, 0.2425212413072586, 0.053489796817302704, 0.4717354476451874, 0.20237646996974945, -0.358807235956192, 0.6665307879447937, -0.31767645478248596, -0.2414020150899887, 0.5197091102600098, -0.8996793031692505, -0.12453814595937729, -0.08311361074447632, 0.33164313435554504, 0.19073894619941711, -0.14752401411533356, 0.7051228284835815, 0.004039408639073372, -0.11468065530061722, -0.3700611889362335, -0.28215616941452026, 0.0699954554438591, -0.005423614755272865, 0.8801136612892151, 0.2609047591686249, -0.07078667730093002, -0.6388183832168579, 0.1091005951166153, -0.4336501657962799, -0.34005898237228394, 0.06957342475652695, 0.30182549357414246, -0.6475688815116882, 0.1974056214094162, 0.04712735861539841, -0.13887231051921844, -0.2466864436864853, 0.11321835219860077, -0.2583466172218323, -0.43890440464019775, -1.0104384422302246, -0.7495378255844116, -0.34654396772384644, 0.07962393015623093, 0.0122184157371521, 0.4870665371417999, 0.7112425565719604, -0.7901960611343384, -0.2809