{"title": "Five of the best 2013 commencement speeches (so far)", "doc_id": "453c36d6170417a08dced599d793c9dc", "author": "Valerie Strauss", "annotation": "690-0", "published_date": "2013/05/19", "content_str": "Leave it to Stephen Colbert to find a way to make Thomas Jefferson funny. That\u2019s what he did when he was speaking to graduates at the University of Virginia \u2014 but he wasn\u2019t the only commencement speaker to get the attention of the crowd this graduation season. First lady Michelle Obama said at Bowie State University\u2019s graduation that too many young people are\u201dfantasizing about being a baller or a rapper\u201d rather than a teacher or lawyer. Former president Bill Clinton remembered exactly what was said at his commencement ceremony 45 years ago and what he learned from it. And there\u2019s more. Here are excerpts and videos of some of the graduation speeches so far in the 2013 commencement season: Stephen Colbert Colbert spoke at the University of Virginia\u2019s Valedictory Exercises, which are ceremonies to honor top students and professors. (His wife, Evelyn McGee Colbert, graduated from U.Va. in 1985 with a drama and English double major.)\u00a0 Colbert cracked up the audience Saturday with Jefferson jokes: If anyone can do this, it is the graduates of the university that Jefferson founded. You are his intellectual heirs. In fact, some of you may be his actual heirs \u2013 we\u2019re still testing the DNA. . And he dared to refer to the upheaval at U-Va., last summer when the school\u2019s Board of Visitors forced out the president, Teresa Sullivan, and then reinstated her after a campus revolt: President Teresa Sullivan, you are way better than the last president \u2013 Teresa Sullivan. You are clearly the woman for this job. My colleague Jenna Johnson wrote about it here, and the university\u2019s Web site had more here. You can watch the whole thing below, and see some of what he said beneath that: \u00a0 This is from the university Web site: Rather than asking people to turn their cell phones off, Colbert said they should turn their phones on to make sure they didn\u2019t miss any texts or tweets \u2013 and just in case he himself tweeted anything during his speech, which, in fact, he did later. \u00a0 He poked fun at some of the unique terms that set U.Va. apart from other universities. \u201cInstead of saying, \u2018We are members of a proud educational tradition dating back to our nation\u2019s founders,\u2019 you say \u2018Wahoowa,\u2019\u201d he said. \u201cWhich begs the eternal question, \u2018Wahoo-why?\u2019\u201d \u00a0 Having toured the Grounds earlier in the morning, he then asked the graduates, \u201cWhy are you leaving? This could be the most spectacular place you have ever lived,\u201d pointing out that the University is the only college campus designated a UNESCO World Heritage site. \u00a0 Another reason the University is so impressive, Colbert said, was because it rejected him when he applied to transfer from Hampden-Sydney College. He said he failed to submit an essay with his application in 1984, and asked if his speech could now serve that purpose. \u00a0 \u201cBecause this is a smart school, let me just toss in some SAT words: syzygy, heterodox, Benedict Cumberbatch,\u201d he said. \u00a0 \u201cBut perhaps the real reason U.Va. is so great is that it trusts its students. You have the nation\u2019s oldest student-run honor code. Say it with me.\u201d He then recited the Honor Code \u2013 \u201cOn my honor as a student, I pledge I have neither given nor received help on this assignment\u201d \u2013 before appending, \u201cso help me Adderall,\u201d referring to a medicine for the treatment of attention deficit hyperactivity disorder that some college students reportedly take to help them focus. \u00a0 His favorite thing about U.Va., Colbert said, are the \nsecret societies \u2013 \u201cThat\u2019s sexy,\u201d he said, proceeding to name a few of them. When he got to the Seven Society, whose members are not revealed until their deaths, he said, \u201cI\u2019m not going to say I am a Seven; I\u2019m not going to say I\u2019m not a Seven. I\u2019m just going to say \u2026\u201d and then he chanted some gibberish while waggling his fingers like a butterfly. After the laughter died down, he added, \u201cAnd now I will have to have you all killed.\u201d \u00a0 He also listed several famous alumni, including Edgar Allan Poe \u2013 whose friends, he said, called him \u201ccreepy Eddie.\u201d \u201cBut of course the greatest figure associated with U.Va. is your founder, Thomas Jefferson \u2013 TJ, Prez Tommy Jeff, the freckly anti-federalist, Louisiana purchee, old Bible slicer, or as most Americans know him, the inventor of the six-inch wooden cypher wheel.\u201d \u00a0 Colbert said one thing he took issue with was the scope of Jefferson\u2019s beliefs, which were too broad and made him hard to pin down, unlike today\u2019s politicians who have to fit into the box of conservative or liberal. \u00a0 Jefferson\u2019s relations with his slave, Sally Hemings, proved to be too tempting a target for Colbert. \u201cIn public life, we often see Jefferson as the embodiment of white male patriarchy,\u201d he said, \u201cbut in his private life, he was known for, shall we say, embracing diversity. Very affirmative in his actions. Am I right? I am right. They did the DNA tests.\u201d \u00a0 He included an advice section in his talk, mentioning TIME magazine\u2019s cover story on today\u2019s young people, which called them \u201clazy, entitled narcissists who are part of the me, me, me generation.\u201d \u00a0 \u201cThat\u2019s very upsetting to us Baby Boomers, because self-absorption is kind of our thing. We\u2019re the original \u2018me generation,\u2019\u201d Colbert said. \u00a0 A bit more seriously, he said, \u201cThere is no secret society out there that will tap you on the shoulder and show you the way. The true secret is, your life will not be defined by the society we have left you.\u201d \u00a0 He told students to have the courage Jefferson and his generation did \u2013 to create something for themselves. \u00a0 Quoting Jefferson, he said: \u201cYour generation, no less than his generation, has their own opportunity to recognize and seize that moment \u2018when in the course of human events it becomes necessary for one people to dissolve the bands that have connected them with another and to assume among the powers of the earth your separate and equal station and for the support of this, mutually pledge to each other your lives, your fortune and your sacred honor.\u2019 \u00a0 \u201cIf anyone can do this, it is the graduates of the university that Jefferson founded. You are his intellectual heirs. \u00a0 \u201cIn fact, some of you may be his actual heirs \u2013 we\u2019re still testing the DNA.\u201d \u2014 Vice President Biden at the University of Pennsylvania: There\u2019ll be no U-Haul truck behind my casket. When I did my financial disclosure as vice president the first time, The Washington Post said, quote, It\u2019s probable no man has \u2026 assumed the office of vice president with fewer assets than Joe Biden. I hope they were talking financial assets. And there was all this discussion about why I\u00a0 had no money. I\u2019ll tell you why I had no money. Four years of Penn, three years of Syracuse, four years of Georgetown, three years at Yale, two yaears at Tulane, two years at Penn, and now a gradndaughter at Penn. I was asked why I wore a Penn tie. My answer is: I earned it. \u00a0 \u2014 Michelle Obama at Bowie State University \u2026 But listen, you dug deep and you kept pushing forward to make it to this magnificent day. (Applause.) And in doing so, you didn\u2019t just complete an important chapter in your own story, you also became part of the story of this great university \u2014 a story that began nearly 150 years ago, not far from where we all sit today. As you all know, this school first opened its doors in January of 1865, in an African Baptist church in Baltimore. And by 1866, just a year later, it began offering education courses to train a new generation of African American teachers. \u00a0 Now, just think about this for a moment: For generations, in many parts of this country, it was illegal for black people to get an education. Slaves caught reading or writing could be beaten to within an inch of their lives. Anyone \u2014 black or white \u2014 who dared to teach them could be fined or thrown into jail. And yet, just two years after the Emancipation Proclamation was signed, this school was founded not just to educate African Americans, but to teach them how to educate others. It was in many ways an act of defiance, an eloquent rebuttal to the idea that black people couldn\u2019t or shouldn\u2019t be educated. And since then, generations of students from all backgrounds have come to this school to be challenged, inspired and empowered. And they have gone on to become leaders here in Maryland and across this country, running businesses, educating young people, leading the high-tech industries that will power our economy for decades to come. \u00a0 That is the story of Bowie State University, the commitment to educating our next generation and building ladders of opportunity for anyone willing to work for it\u2026. \u00a0 But today, more than 150 years after the Emancipation Proclamation, more than 50 years after the end of \u201cseparate but equal,\u201d when it comes to getting an education, too many of our young people just can\u2019t be bothered.\u00a0 Today, instead of walking miles every day to school, they\u2019re sitting on couches for hours playing video games, watching TV.\u00a0 Instead of dreaming of being a teacher or a lawyer or a business leader, they\u2019re fantasizing about being a baller or a rapper.\u00a0 (Applause.)\u00a0 Right now, one in three African American students are dropping out of high school.\u00a0 Only one in five African Americans between the ages of 25 and 29 has gotten a college degree \u2014 one in five. \u00a0 But let\u2019s be very clear.\u00a0 Today, getting an education is as important if not more important than it was back when this university was founded.\u00a0 Just look at the statistics.\u00a0 (Applause.)\u00a0 People who earn a bachelor\u2019s degree or higher make nearly three times more money than high school dropouts, and they\u2019re far less likely to be unemployed.\u00a0 A recent study even found that African American women with a college degree live an average of six and a half years longer than those without.\u00a0 And for men, it\u2019s nearly 10 years longer.\u00a0 So yes, people who are more educated\u2026 actually live longer. \u00a0 You can read the full transcript here. \u00a0  \u00a0 \u2014 Bill Clinton at Howard University In 2009, I was inducted as an honorary member of\u00a0 Phi Beta Sigma, which was founded here 99 years ago. I\u2019m not quite that old although I look like it some days\u2026. \u00a0 I am well aware that the commencement speech is the least important part of this day. I congratulate all of you who are here, your parents, your friends, your loved ones\u2026 But unlike almost every other person here who is older, I actually remember who gave my commencement speech 45 years ago next month. And I remember exactly what the speech was. We were like this on the lawn at Georgetown just across town. It started out to be a clear day, then and all of a sudden this huge storm cloud came over and the lightning began to dance in the sky. And a Howard graduate, the mayor of Washington D.C., Walter Washington, stood up at the podium as I am.\u00a0 He looked at the sky, he looked at the shivering students and he said, \u201cCongratulations. If we don\u2019t get out of here, we\u2019re all going to drown. If you want a copy of my speech, you write me and I\u2019ll send you one. Good luck.\u201d And off we went. \u00a0 Now what did I learn from that? The most successful commencement speeches are brief, and highly relevant. So wherever you are Mr. Mayor, thank you for the memory\u2026. \u00a0 We are all 99 and a half percent [genetically] the same. Now because of our ability to do genetic history we found interesting relatives, you know, which has made for funny things. Some of the people in Washington politicians over the last 10 years in their lineage have embarrassed them in terms of their current politics. But the most important thing is that we are all 99 and a half percent the same.\u00a0 The other thing is before we get too arrogant about this, we\n all spend 99 and half percent of our time thinking about the half of a percent of us that is different. Don\u2019t we?\u2026 The half a percent matters. It gave Einstein the biggest brain ever measured. He made pretty good use of it. It\u2019s a good thing. That half a percent means LeBron James is hard to stop if he is driving for a basket. The half a percent matters. But so does the 99 and a half percent. And that\u2019s why this service ethic counts. And when you leave here I want you to never to forget\u00a0 for the rest of your life in the good times and bad that we live in an interdependent world and we\u2019ve got to pull it together which means to be a good citizen you\u2019ve got to something sometime for someone else because they are just like you are. \u00a0 \u00a0 \u00a0 \u00a0 \u2014 Twitter CEO Dick Costolo at the University of Michigan \u00a0You know I have to start by tweeting this. So just give me one second. I\u2019m a professional so this will only take a second\u2026. \u00a0 When I woke up this morning and started writing my speech I was thinking about my first month on campus when I was a freshman and the football team went into the season ranked [very high] and we lost our first game 21-14\u2026I\u2019d like you to think of that soaring expectation followed by crushing disappointment as a metaphor for your next 20 minutes with me\u2026 \u00a0 When I was your age, we didn\u2019t have the Internet in our pants. We didn\u2019t even have the Internet not in our pants. That\u2019s how bad it was. I know I sound like my grandfather right now. We didn\u2019t have teeth! There were no questions marks, we just had words! What was I talking about? The Internet\u2026 \u00a0 Not only can you not plan the impact you\u2019re going to have, you often won\u2019t recognize it when you\u2019re having it\u2026 \u00a0", "default_text": [[" First lady Michelle Obama said too many young people are fantasizing about being a baller or a rapper . Former president Bill Clinton remembered exactly what was said at his commencement ceremony 45 years ago and what he learned from it ."], [" He dared to refer to the upheaval at U.Va. last summer when the school\u2019s Board of Visitors forced out the president, Teresa Sullivan, and reinstated her after a campus revolt . Rather than asking people to turn their cell phones off, Colbert said they should turn their phones on to make sure they didn\u2019t miss any texts or tweets ."], [" Colbert said the University rejected him when he applied to transfer from Hampden-Sydney College in 1984 . He said he failed to submit an essay with his application in 1984, and asked if his speech could now serve that purpose . Colbert then asked graduates, \u201cWhy are you leaving? This could be the most spectacular place you have ever lived\u201d"], [" His favorite thing about U.Va., Colbert said, are the secret societies \u2013 \u201cThat\u2019s sexy,\u201d he said . He also listed several famous alumni, including Edgar Allan Poe \u2013 whose friends, he said, called him \u201ccreepy Eddie\u201d"], [" Colbert took issue with the scope of Jefferson\u2019s beliefs, which were too broad and made him hard to pin down . \u201cIn public life, we often see Jefferson as the embodiment of white male patriarchy,\u201d Colbert said . He included an advice section in his talk, mentioning TIME magazine's cover story on young people ."], [" \u201cWe\u2019re the original \u2018me generation,\u2019\u201d Colbert said . He told students to have the courage Jefferson and his generation did \u2013 to create something for themselves ."], [" Vice President Biden at the University of Pennsylvania: There\u2019ll be no U-Haul truck behind my casket . Biden: \u201cListen, you dug deep and you kept pushing forward to make it to this magnificent day. (Applause.)\u201d"], [" For generations, in many parts of this country, it was illegal for black people to get an education. Slaves caught reading or writing could be beaten to within an inch of their lives. Anyone \u2014 black or white \u2014 who dared to teach them could be fined or thrown into jail. And yet, just two years after the Emancipation Proclamation was signed, this school was founded . It was in many ways an act of defiance, an eloquent rebuttal to the idea that black people couldn't or shouldn't be educated. And since then, generations of students from all backgrounds have come to this school ."], [" One in three African American students are dropping out of high school . Only one in five African Americans between the ages of 25 and 29 has gotten a college degree . Bowie State University is committed to educating our next generation and building ladders of opportunity for anyone willing to work for it ."], [" Clinton: Today, getting an education is as important as it was back when Howard University was founded . People who earn a bachelor\u2019s degree or higher make nearly three times more money than high school dropouts . Clinton: African American women with a college degree live an average of six and a half years longer than those without ."], [" The most successful commencement speeches are brief, and highly relevant . We are all 99 and a half percent [genetically] the same. We found interesting relatives because of our ability to do genetic history ."], [" We all spend 99 and half percent of our time thinking about the half of a percent of us that is different . The half a percent matters. But so does the 99 and a half percent ."], [" Twitter CEO Dick Costolo: \"When I was your age, we didn\u2019t have the Internet in our pants. That\u2019s how bad it was. I know I sound like my grandfather right now. We didn't have teeth! There were no questions marks, we just had words!\""]], "default_vector": [[-0.12719708681106567, -0.18461646139621735, -0.02960878424346447, -0.5642321109771729, -0.26854732632637024, 0.08574222773313522, -0.9765373468399048, 0.5450235605239868, -0.1444271206855774, 0.04490191861987114, -0.10487105697393417, -0.16052018105983734, -0.07892851531505585, -0.3305041491985321, -0.11342683434486389, -0.3081231117248535, -0.5532702207565308, -0.49470967054367065, 0.0888720378279686, -0.04177016764879227, -0.014482908882200718, 1.283957839012146, 0.20329710841178894, -0.25959673523902893, -0.10781310498714447, -0.3456961512565613, 0.4828394651412964, -0.19739419221878052, -0.2820741832256317, 0.09715159237384796, -0.07299643009901047, 0.04646984115242958, 0.44099003076553345, -0.09636018425226212, -0.07451821118593216, -0.6567291021347046, 0.28378134965896606, 0.30740827322006226, -0.08146485686302185, 0.11050058156251907, -0.8010808229446411, -0.13986726105213165, 0.596932590007782, -0.09659818559885025, 0.18591976165771484, 0.06349529325962067, 0.8771061897277832, 0.09303494542837143, 0.09687963128089905, -0.19352920353412628, 0.03626608848571777, -0.29893603920936584, 0.505304217338562, 0.14372462034225464, -0.12197295576334, -0.42158493399620056, -0.5721691846847534, -0.8393139243125916, -0.052416279911994934, -0.5509113669395447, 0.6127507090568542, 0.41626036167144775, 0.042937472462654114, -0.3835386335849762, 0.40966013073921204, 0.636135458946228, -0.48826858401298523, 0.02284003235399723, -0.00974730309098959, 0.2681123912334442, -0.14145717024803162, -0.13620175421237946, 0.46183690428733826, 0.40341874957084656, 0.47624471783638, 0.090884715