{"title": "Wildlife at Chernobyl is now thriving", "doc_id": "e0242a48971d4844258cbf8a5e783da0", "author": "Brian Feldman", "annotation": "805-0", "published_date": "2015/10/05", "content_str": "After more than 100,000 people permanently evacuated the area in 1986, the population of local wildlife thrived, indicating that long-term radiation was not devastating to local populations \u2014 or at least, not more injurious than a human population. (Guardian) \u201cMaze Runner\u201d cast under fire for stealing artifacts. On a talk show star, the film\u2019s star, Dylan O\u2019Brien, admitted that the cast took objects from a Native American site in Albuquerque while filming there, despite being told not to. A petition circulating calls on those involved \u201cto apologize to Pueblo tribal leaders for their behavior and return any artifacts they removed from the site.\u201d (Hollywood Reporter) Fans mourn mysterious death of YouTube star. Caleb Logan Brataley, the star of the popular low-budget YouTube series \u201cThe Brataleys,\u201d died of natural causes over the weekend, though there are many unknown details. Caleb\u2019s name was a pseudonym, and the parents who documented him and his two siblings also remain anonymous. Tween fans have taken to Instagram to mourn the online stars passing. (Gawker, Jezebel) Angry protesters rip clothes off Air France executives. Managers at the embattled airliner\u00a0had to scale an eight-foot security fence in order to escape the mob, which was angry over 2,900 impending job cuts. One man lost his shirt while\u00a0another had\u00a0his suit destroyed. (Bloomberg) North Korea will released detained American college student. Jong Won-moonwas detained in April after crossing into the country from China. He had hoped that his crossing over would strengthen ties between North and South Korea. (NPR) More than a hundred involved in the Waco shootout are no longer wearing monitoring ankelets. May\u2019s shootout resulted in 135 bikers being ordered to wearing the GPS monitors, but now only 22 are still required to have them. Nobody has been charged in the deaths of nine people killed during the incident. (Associated Press) LinkedIn will pay out $13 million to users annoyed by emails. The social network is settling the class action lawsuit over the reminders. Users have until December 14 to file a claim in order to receive a payout. (Mashable) Iraq opens Green Zone to the public for the first time in 12 years. Prime Minister Haider al-Abadi declared the heavily fortified Green Zone \u2014 home to many government buildings and embassies and protected by barriers and checkpoints \u2014 open to the public as part of reforms in the wake of sustained criticism against the country\u2019s leaders. (Reuters) American Apparel files for bankruptcy. Thanks to \u201chuge debts, a precipitous fall in sales, employee strife and a drawn-out legal battle with the retailer\u2019s ousted founder, Dov Charney,\u201d the once-hip clothing maker filed for Chapter 11 protection early today. No layoffs were announced as part of the filing, and the deal, which still has to be approved, would keep all 130 stores open.\u00a0(New York Times) ATM fees are getting higher and higher. A survey found that the average ATM fee has risen to a record $4.52 per transaction. Up 21 percent over the past five years, the spike is in part due to pressure from regulators to decrease fees for customers elsewhere. (Wall Street Journal) 17 dead as floods pummel French Riviera. Four people are missing and thousands are without power after heavy rain Saturday caused severe flash flooding. Estimates say the area \u201creceived more than 10 percent of its average yearly rainfall in two days alone.\u201d (BBC) Plant sales on eBay pose a threat to the environment. According to a new study, the Web site has a large trade in unregulated plant sales. Research showed that over a 50-day period, \u201c2,625 plant species were on sale \u2026 from 65 countries, and 510 of them were identified as an invasive species in at least one region of the world.\u201d (Atlantic)", "default_text": [[" \u201cMaze Runner\u2019s Dylan O\u2019Brien admitted that the cast took objects from a Native American site in Albuquerque while filming there . Caleb Logan Brataley, the star of the popular low-budget YouTube series \u201cThe Brataleys, died of natural causes over the weekend ."], [" Angry protesters rip clothes off Air France executives . North Korea will release detained American college student Jong Won-moon . LinkedIn will pay out $13 million to users annoyed by emails ."], [" American Apparel files for bankruptcy . Survey finds average ATM fee has risen to a record $4.52 per transaction . Iraq opens Green Zone to the public for the first time in 12 years ."], [" Study: 510 of eBay's 2,625 plant species were identified as an invasive species in at least one region of the world . eBay is in part due to pressure from regulators to decrease fees for customers elsewhere . 17 dead as floods pummel French Riviera ."]], "default_vector": [[-0.1518760621547699, 0.24576221406459808, -1.0086003541946411, 0.01015659049153328, 0.6242650151252747, -0.20321698486804962, 1.21665358543396, -0.10437416285276413, 1.1218750476837158, 0.34810325503349304, -0.21455326676368713, -0.24413849413394928, -0.11347627639770508, 0.6276189684867859, 0.39112114906311035, 0.18864232301712036, -0.8163611888885498, -0.38175490498542786, 0.8502132296562195, 0.2346547245979309, 0.031094077974557877, 0.38806596398353577, -0.19265057146549225, 0.21101002395153046, 0.0031746337190270424, 0.5169738531112671, -0.22774939239025116, 0.20978747308254242, -0.08650006353855133, -0.36911049485206604, 0.23591554164886475, -0.0718669593334198, 0.045051369816064835, -0.17679375410079956, 0.19188055396080017, -0.3827614486217499, -0.3500101566314697, 0.22401252388954163, -0.34117090702056885, 0.4907475709915161, -0.5076649188995361, 0.1798970252275467, -0.5838366150856018, -0.047