{"title": "The science of disgust: Why we (most of us) hate liver, brussels sprouts and cricket flour", "doc_id": "b03726fe33683f7675eb35102731ed53", "author": "Meeri Kim", "annotation": "805-0", "published_date": "2015/10/12", "content_str": "Whether you consider yourself a picky eater or an adventurous one, just about everyone has those foods they loathe or just won't touch. Polarizing foods, such as cilantro, mushrooms, or olives, can render a dish inedible for some. Others feel a bit queasy at the thought of eating offal, the internal organs of an animal, such as brain, testicles and heart. And to the average American, bugs are creatures never to be eaten except perhaps by accident. But from where do our food aversions originate, and why do we feel disgusted by certain edible items and not others? Are there ways to overcome food aversions, or are they somewhat innate? Let's start with perhaps the most polarizing food of all: insects. While tempura-fried crickets or mealworm tacos may not sound appetizing,\u00a0entomophagy[time.com]\u00a0or insect consumption is practiced regularly by at least 2 billion people worldwide with more than 1,900 edible species. Despite all the benefits \u2014 insects can be highly nutritious, environmentally friendly, tasty, and safe for consumption \u2014 seeing bugs as food remains hard for most Western societies to swallow. \u201cAlmost everything that's disgusting is of animal origin, but cultures vary as to what they find disgusting,\u201d said\u00a0Paul Rozin, professor emeritus in psychology at the University of Pennsylvania, who is often called the father of disgust for his extensive research on the subject. \u201cWe eat cheese \u2014 rotted milk \u2014 but other cultures find that disgusting. South Asian cultures eat fish sauce which is made of rotted fish, but they love it.\u201d If so many other societies are happily feasting on insects as a source of protein, our aversion must be psychological in origin. The disgust reaction is based not on taste, said Rozin, but on knowledge of the nature or origin of the food in question. Our brains can't shake the feeling of pure disgust when thinking about taking a creature normally avoided at all costs, putting its dead carcass in our mouths, and crunching down on it. \u201cIf you take a glass of clearly good juice and pour it right out of the closed container, people drink it of course. If you drop a dead, sterile cockroach in it and take it out immediately, people won't drink it,\u201d he said, referring to\u00a0a study he actually performed\u00a0using undergraduates and a 4-inch cockroach carcass. \u201cThese disgusting things have the power to make something inedible even if they briefly touch it.\u201d In psychological terms, the juice has taken on some property of the cockroach in the subject's mind despite the bug being sterilized and safe \u2014 the juice has been effectively \u201croached.\u201d However, dipping a piece of broccoli into the glass of juice wouldn't have nearly the same effect as the cockroach, even on someone who despised the vegetable. So the reasoning behind these more ordinary types of food aversions must have a different origin \u2014 one that still remains largely a mystery. \u201cEvery person has a bunch of foods they like, and a bunch of foods they don't like, and we can't explain why,\u201d said Rozin. \u201cAlmost everyone likes chocolate because it's got everything in it \u2014 fat, sweet, aroma. Pizza is another one.\u201d Humans have an innate taste for sweet and fat and a built-in dislike of bitter and spicy substances, but the rest is learned. Hence, our upbringing plays a large role in what we find disgusting. Food aversion can also be acquired through a single unfortunate incident, like getting sick after eating, that gets forever burned into your brain. For instance,\u00a0pickiness in children\u00a0is thought to be associated with a negative experience such as vomiting, choking, an allergic reaction, or force-feeding. Oversensitivity to certain flavors is another cause of food aversions.\u00a0Genetic studies\u00a0have shown that how strongly we sense bitter and sweet flavors is influenced by a single gene that codes for a taste receptor on our tongues.\u00a0Research has also identified a genetic component\u00a0to the perception of cilantro that may explain why its haters claim it tastes soapy rather than refreshing. To learn more about how to overcome food aversions, Rozin has studied\u00a0the odd case of the chili pepper. It is one of the most common spices used throughout the world, yet contains an irritant substance called capsaicin that causes a burning sensation in the mouth when ingested. This family of chemicals serves to normally deter mammals who happen to sample a pepper from ever eating them again. Infants and young children (usually) don't like spicy food, and even older people who\u00a0try it for the first time don't always enjoy it. Often, spice lovers will cite a past negative experience where they ventured too far beyond their tolerance, resulting in painful consequences. So why do people so commonly acquire a taste for hot foods? Repeated exposure, as well as what Rozin calls \u201cbenign masochism.\u201d As far as we know, humans are the only species to enjoy initially negative experiences under safe or controlled conditions. Similar to roller coasters, haunted houses, or tearjerker movies, eating chili peppers allows us to brave a negative situation without really putting ourselves in harm's way. With spicy eating challenges now being offered by restaurants across the nation, perhaps eating bugs will become the next food dare? Regardless, Rozin thinks that disgust can be overcome either by positive exposures or by not thinking about the origin of the food. For instance, with entomophagy, enthusiasts can go the route of making insects taste delicious or completely hiding their bugginess by grinding them up \u2014\u00a0like with cricket flour that\u00a0is being marketed as the next big thing in protein powder. \u201cThe problem is getting over the first step. It's like getting into the ocean \u2014 it's cold at first, but it only lasts a few seconds,\u201d Rozin said. \u201cPeople do all sorts of things that are disgusting. They go to the bathroom, that\u2019s disgusting. So the trick [to having people eat something disgusting] is to get them over the initial hump.\u201d Read more: Neighbors file 'extraordinary, unprecedented' public nuisance lawsuit against family of autistic boy Here's why more sex, even on 'off' days, may\u00a0up\u00a0your chances of pregnancy The problem with recess in the United States: We get\u00a027\u00a0minutes. Finnish kids get 75, Japanese kids even more. Why your first-born is more likely to be near-sighted SPECIAL REPORT: Billionaire Paul Allen's quest to build an artificial brain For more health news, you can sign up for our weekly newsletter\u00a0here.", "default_text": [[" Polarizing foods, such as cilantro, mushrooms, or olives, can render a dish inedible for some . Entomophagy is practiced regularly by at least 2 billion people worldwide with more than 1,900 edible species . Despite all the benefits, insects can be highly nutritious, environmentally friendly, tasty, and tasty ."], [" The disgust reaction is based not on taste, but on knowledge of the nature or origin of the food in question . South Asian cultures eat fish sauce which is made of rotted fish, but they love it ."], [" The study was done with undergraduates and a 4-inch cockroach carcass . In psychological terms, the juice has taken on some property of the cockroach in the subject's mind . However, dipping a piece of broccoli into the glass of juice wouldn't have nearly the same effect as the bug ."], [" Humans have an innate taste for sweet and fat and a built-in dislike of bitter and spicy substances . Our upbringing plays a large role in what we find disgusting . Food aversion can also be acquired through a single unfortunate incident, like getting sick after eating ."], [" The chili pepper contains an irritant substance called capsaicin that causes a burning sensation in the mouth when ingested . Infants and young children (usually) don't like spicy food, and even older people who try it for the first time don't always enjoy it . Repeated exposure and what Rozin calls \u201cbenign masochism\u201d"], [" Entomophagy expert says disgust can be overcome by positive exposures or by not thinking about the origin of the food . Rozin: \"The problem is getting over the first step. It's like getting into the ocean \u2014 it's cold at first, but it only lasts a few seconds,\u201d Rozin said ."], [" The problem with recess in the United States: We get 27 minutes . Finnish kids get 75 minutes, Japanese kids even more ."]], "default_vector": [[-0.1427367627620697, 0.04913085326552391, -0.0005522044375538826, 0.4046306312084198, -0.0036450934130698442, 0.2809111475944519, -0.030893221497535706, 0.9803449511528015, -0.22177596390247345, -0.023391881957650185, -0.36103343963623047, -0.11263422667980194, -0.00497732637450099, -0.15512825548648834, 0.24526962637901306, 0.4317243993282318, -0.4944652318954468, -0.7362363934516907, -0.1982230842113495, 0.028102155774831772, -0.2287052720785141, -0.7244176268577576, -0.18632128834724426, -0.25935450196266174, -0.3851143419742584, -0.5156794190406799, 0.16110996901988983, 0.0014319483889266849, -0.0741656944155693, -0.1350804567337036, 0.2892785966396332, 0.5106008648872375, 0.3381917178630829, -0.03130903095006943, 0.06478673219680786, 0.12262032926082611, 0.28669974207878113, -0.2123243659734726, -0.08351843804121017, 0.23815740644931793, 0.15766721963882446, 0.5796557664871216, -0.05766305327415466, -0.4341367483139038, 0.272292822599411, -0.3398016393184662, -0.22970542311668396, -0.19347289204597473, -0.6574241518974304, 0.22417424619197845, 0.2757954001426697, -0.8269557952880859, -0.5486503839492798, -0.15249529480934143, -0.6664257645