{"title": "More than 200 new species found in Eastern Himalayas, including a \u2018walking\u2019 fish", "doc_id": "bbfe716ce35e4e1f5015c925796e4cae", "author": "Elahe Izadi", "annotation": "805-0", "published_date": "2015/10/13", "content_str": "There's a dwarf\u00a0snakehead\u00a0fish that lives in the Eastern Himalayas, and it\u00a0walks upon the earth. The Channa andrao snakehead, which breathes atmospheric air and can live on\u00a0land for four days at a time,\u00a0is one of more than 200 species discovered between\u00a02009 and 2014, as detailed in a report this month by the World Wildlife Federation. [Walking fish raised on land mimic ancient evolutionary transition] An average of 34 new species were discovered every year since 2009 in the Eastern Himalayan\u00a0region, which includes Bhutan, northeastern India, Nepal, northern Myanmar and southern Tibet. The WWF\u00a0report also highlights the precarious standing\u00a0of these species; just 25 percent of the region's original habitats remain, due to development. Poaching, overgrazing and the wildlife trade also threaten species, according to the report. \u201cThe challenge is to preserve our threatened ecosystems before these species, and others yet unknown are lost,\u201d Sami Tornikoski of\u00a0WWF Living Himalayas Initiative said in a statement. A total of 26 fish were found in recent years. The\u00a0dwarf snakehead fish, native to West Bengal's Lefraguri swamp, comes in a vibrant blue and \"walks\" in a cumbersome way\u00a0--\u00a0nothing like the smooth movements of a slithering snake. These primitive creatures lack pelvic fins, and members of the Channa\u00a0genus of snakeheads can grow up to nearly 4 feet long. Females can release up to 15,000 eggs at a time, according to the report. [This deep sea creature looks just like the Flying Spaghetti Monster] Nearly one-third of the world's known\u00a0Channa snakeheads live in the Eastern Himalayan region, making it an epicenter of snakehead diversity. Just one mammal was\u00a0recently discovered in the region:\u00a0a monkey with an upturned nose. This poor fellow, called Rhinopithecus strykeri, has a tough go of it when it rains. \"Locals claim that the black and white monkey is very easy to find when it is\u00a0raining because the monkeys often get rainwater in their upturned noses\u00a0causing them to sneeze,\" the WWF report reads. \"To avoid this evolutionary inconvenience,\u00a0snub-nosed monkeys spend rainy days sitting with their heads tucked\u00a0between their knees.\" READ MORE: Potomac Fever The newest crayfish species looks like a Lisa Frank creation Catfish species\u00a0named after Greedo from \u2018Star Wars\u2019 This aggressive fish can live for days on land, dragging itself along with its gills Freshwater sharks rediscovered in Papua New Guinea fish market after 50 years", "default_text": [[" The Channa andrao snakehead is one of more than 200 species discovered between 2009 and 2014 . An average of 34 new species were discovered every year since 2009 in the Eastern Himalayan region . Poaching, overgrazing and the wildlife trade also threaten species ."], [" The dwarf snakehead fish is native to West Bengal's Lefraguri swamp . Members of the Channagenus of snakeheads can grow up to nearly 4 feet long . Females can release up to 15,000 eggs at a time ."], [" The newest crayfish species looks like a Lisa Frank creation . Snub-nosed monkeys spend rainy days sitting with their heads tucked between their knees ."]], "default_vector": [[-0.3728242814540863, 0.23205308616161346, -0.4807363450527191, -0.5888105034828186, 0.28208401799201965, 0.24488215148448944, 0.13942523300647736, 0.21019554138183594, -0.4319876730442047, 0.27548450231552124, 0.22498685121536255, -0.3778931498527527, 0.06789298355579376, 0.32223600149154663, 0.06312761455774307, -0.027848204597830772, -0.23523250222206116, -0.6222968101501465, -0.09726043790578842, -0.04255511611700058, 0.16557136178016663, -0.7180209755897522, -0.22716210782