{"title": "Why Australia has to kill 2 million cats", "doc_id": "4679869bc07ec0bafd0bcf991e4e1a7a", "author": "Rachel Feltman", "annotation": "805-0", "published_date": "2015/10/14", "content_str": "It's no surprise that Australia's recently announced plan to kill 2 million feral cats by 2020 received a lot of backlash. And\u00a0after loud outcries from some very famous dissenters, the government is trying to\u00a0defend\u00a0its decision. The cull isn't part of some cruel anti-cat agenda. In Australia, feral cats \u2014\u00a0which were introduced by the first European settlers \u2014\u00a0have become a huge threat to native wildlife. They're blamed for the extinction of several species unique to the country. Like many invasive species, they're a little too good at killing the locals \u2014\u00a0and as they thrive and breed, the problem is only getting worse. [Australia is low on koala food and may need to kill some of the iconic creatures] British singer Morrissey and French actress Bridgette Bardot, both veteran animal rights activists, have penned open letters to the government condemning the cull. \u00a0 \"The cats are, in fact, two million smaller versions of Cecil the lion,\" Morrissey wrote, calling the cull \"idiocy.\" Bardot panned the\u00a0\"animal genocide\" as \"inhumane and ridiculous.\" Because we domesticate them, branding cats as dangerous pests can be a tough pill to swallow. Even in Australia, pet cats are A-OK\u00a0\u2014\u00a0as long as they're neutered, microchipped, and not allowed to roam around hunting. In an open letter that begins by thanking Bardot for her commitment to protecting wildlife, Australia's Threatened Species Commissioner Gregory Andrews tried to defend his government's position. [This hunter wants an endangered rhino\u2019s head as a trophy. Looks like he\u2019ll get it.] \"We are home to more than 500,000 species, most of which are found nowhere else in the world. Our animals and plants define us as a nation, so when we lose them, we lost a part of who we are as a country,\" Andrews wrote. \"But our wildlife has endured\u00a0one of the highest extinction rates in the world. We have lost 29 unique Australian mammal species over the last 200 years. This represents 35 percent of the world's modern mammal extinctions and is the highest rate of mammal extinctions in the world.\" [Scientists investigate the cat genome to see how wildcats turned into lazy furballs] Much of this, Andrews explained, can be attributed to the fast proliferation and adept hunting skills of the feral cat population. Feral cats, he said, have been fingered as direct threats to\u00a0at least 124 of the country's threatened species.\u00a0 He also pointed out that scientists estimate that Australia is home to about 20 million feral cats, and that they kill an average of five animals \u2014\u00a0bugs, lizards, small mammals and birds, and so on \u2014\u00a0each night. The cull of 2 million will focus on cats living in remote desert areas, where wildlife is most threatened. He pressed that the cull is just part of a larger effort, which will also include building fences to prevent feral cats from entering threatened areas. Nobody is relishing the thought of killing a bunch of cats, clearly. And even if all 20 million were wiped out, Australia would still have some of the worst invasive species in the world to deal with. But while it may make pet owners cringe, the cull is environmentally sound \u2014\u00a0and necessary. Read More: An endangered giant tortoise population is finally stable, thanks to some aggressive goat eradication Your cat might not really care about you, study suggests Australia is low on koala food and may need to kill some of the iconic creatures Science finally tells us how cats want to be petted Uh-oh: One of the world\u2019s worst invasive species just showed up in the United States", "default_text": [[" Australia's plan to kill 2 million feral cats by 2020 received a lot of backlash . Feral cats have become a huge threat to native wildlife . They're blamed for the extinction of several species unique to the country ."], [" Australia's Threatened Species Commissioner Gregory Andrews wrote an open letter defending his country's wildlife policy . The letter calls the killing of a pet cat \"inhumane and ridiculous\""], [" Australia is home to about 20 million feral cats . The cull will focus on cats living in remote desert areas, where wildlife is most threatened . Feral cats have been fingered as direct threats to at least 124 of the country's threatened species ."], [" The cull may make pet owners cringe, but it's environmentally sound and necessary . The cull is environmentally sound \u2014 and necessary, experts say ."]], "default_vector": [[0.04159766808152199, -0.162478506565094, 0.2347436398267746, 0.13724187016487122, -0.6713899374008179, 0.5329881906509399, 0.3936774730682373, -0.6936439275741577, -0.22418975830078125, -0.05829130485653877, -0.6914082169532776, -0.20461873710155487, -0.25153443217277527, 0.35880234837532043, 0.3078635334968567, 0.23266904056072235, 0.04381289705634117, -0.4598615765571594, -0.029541349038481712, 0.0011420457158237696, -0.17169898748397827, -0.2257794439792633, 0.2866436839103699, 0.7865597009658813, -0.47173067927360535, -0.5087553858757019, 1.1632968187332153, 0.3032023310661316, 0.10003668069839478, 0.24022255837917328, 0.17302773892879486, -0.679350733757019, -0.4742696285247803, 0.12681981921195984, 0.3738354444503784, -0.4778752028942108, -0.0740339607000351, -0.13409411907196045, 0.12236449867486954, 0.2979772686958313, -0.5299980044364929, 0.000834610138554126, 0.13064725697040558, 0.41165509819984436, 0.12079615890979767, -0.2391863763332367, 0.06892377138137817, -0.3713267743587494, 0.2563343644142151, -0.2091689258813858, 0.6203522682189941, -0.2927651107311249, -0.5573475360870361, 0.1748705804347992, -0.3048149347305298, 0.10410110652446747, -0.2050676792860031, -1.0791856050491333, -0.21796941757202148, 0.61