{"title": "Bernie Sanders said Iraq was \u2018the worst foreign policy blunder\u2019 in U.S. history. Really?", "doc_id": "cb96b54cdb2f763206a99d8f43f66f11", "author": "Adam Taylor", "annotation": "805-0", "published_date": "2015/10/14", "content_str": "Speaking at the Democratic presidential debate in Las Vegas on Tuesday evening, Sen. Bernie Sanders, criticizing Hillary Clinton's vote in support of the Iraq war in 2002, suggested\u00a0that the U.S.-led invasion of Iraq was\u00a0\u201cthe worst foreign policy blunder in the history of the country.\u201d That's a mighty statement. Even those who opposed or have come to regret the Iraq war might have been left scratching their heads and asking: Wait, is it really? The truth is there's no simple answer to that question. The best you can say really is: Well ... maybe. [Now what? Where the Democratic candidates are headed after the first debate.] It's worth noting first, however, that Sanders's comment may have been a slip of the tongue. In the past, the Vermont senator\u00a0has offered a slightly more cautious assessment of the Iraq war, describing it as being \"considered one of the worst foreign policy blunders in the history of the United States.\" During the debate, his official Twitter account tweeted a message with a similar wording. (Martin O'Malley, another Democratic presidential hopeful who said he agreed with Sanders on Iraq,\u00a0also qualified that\u00a0it was \"one of the worst blunders\" during the debate.) Even so, there are certainly those who argue passionately\u00a0that Iraq really does stand out as the worst U.S. foreign policy decision. In 2013, Peter van Buren, a veteran of the U.S. State Department and writer, wrote a widely circulated\u00a0post on Tom's Dispatch that put forward that argument on the war's 10th anniversary. As Van Buren put it: Not to put too fine a point on it, but the invasion of Iraq turned out to be a joke. Not for the Iraqis, of course, and not for American soldiers, and not the ha-ha sort of joke either. And here\u2019s the saddest truth of all: on March 20th as we mark the 10th anniversary of the invasion from hell, we still don\u2019t get it. In case you want to jump to the punch line, though, it\u2019s this: by invading Iraq, the U.S. did more to destabilize the Middle East than we could possibly have imagined at the time. And we \u2014 and so many others \u2014 will pay the price for it for a long, long time. Others have, perhaps less enthusiastically, made similar arguments.\u00a0The Post's own George Will has dubbed the 2003 invasion of Iraq \"the worst foreign policy decision in U.S. history.\" Senate Minority Leader Harry Reid (D) has also\u00a0called the invasion the \"worst foreign policy decision in the history of the country.\" It's not too difficult to see how you could come to this assessment. The invasion of Iraq was motivated by the rationale that Iraq possessed weapons of mass destruction. After the invasion, no real evidence of these weapons was found and many suspected U.S. authorities of misleading the public.\u00a0A relatively quick and successful invasion soon turned into a protracted conflict against\u00a0an committed and dedicated insurgency. Almost 5,000 U.S. troops died in the conflict, while the total cost of the war was estimated to have been more than $2 trillion in 2013. By one\u00a0estimate, the Iraq war resulted in the deaths of at least 144,318 civilians. Many would argue that the conflict created instability in the region and led to further sectarianism and extremism, much like that we see now in Syria. The thing is, as terrible as the Iraq war was, there have been plenty of other contenders for the worst foreign policy decision in U.S. history. The Vietnam War, for example, is another oft-cited debacle. That war certainly killed more than the conflict in Iraq: Over 60,000 members of the United States armed forces were killed or were\u00a0missing in action. Total estimates for the deaths from that war range from 1.5 million to 3.8 million. Another example that would spring to mind for many is Bay of Pigs, the CIA-sponsored\u00a0military invasion of Cuba in 1961. That invasion is widely remembered as an absolute disaster, with an invasion force of around 1,400 militiamen completely outnumbered by around 200,000\u00a0to\u00a0300,000 forces loyal to\u00a0Fidel Castro's left-wing government.\u00a0As\u00a0historian\u00a0Theodore Draper famously\u00a0put it, it was \"one of those rare events in history\u00a0\u2014 a perfect failure.\" It helped contribute to a Cold War antagonism that could potentially have descended into nuclear war. Other suggestions might be the CIA's involvement in the 1953 Iranian coup that ousted the democratically\u00a0elected government of\u00a0Mohammad Mossadegh, a move that\u00a0seriously damaged the U.S. reputation in the Middle East and directly informs the antagonism between Washington and Tehran that continues to this day. Or an\u00a0argument could be made for\u00a0the U.S. failure\u00a0to join the League of Nations\u00a0after it was created in 1919, a decision that\u00a0many argue contributed greatly in the organization's failure to bring world peace. Your perspective on which foreign policy blunder was the worst likely depends on a variety of factors, including (but not limited to) ideology and attitudes to history: At the end of the day, it's likely subjective. What we can say is that, polls do suggest that most Americans view the Iraq war as a mistake. Last year, for example, the polling company YouGov asked what was the biggest mistake in American history. The Iraq and Vietnam wars came in tied at\u00a0third place, each with 8 percent of the vote.\u00a0The only mistakes that placed higher were\u00a0the treatment of Native Americans (with 12 percent) and slavery (with 30 percent) \u2014 mistakes that might now be considered domestic issues, though in the past\u00a0had considerable elements of foreign policy.", "default_text": [[" Sen. Bernie Sanders suggested that Hillary Clinton's vote in support of the Iraq war in 2002 was \"the worst foreign policy blunder in the history of the country\" Sanders's comment may have been a slip of the tongue . In the past, the Vermont senator has offered a slightly more cautious assessment of the war ."], [" In 2013, a veteran of the U.S. State Department and writer put forward that argument on the war's 10th anniversary . Martin O'Malley, another Democratic presidential hopeful, also qualified that Iraq was \"one of the worst blunders\""], [" George Will has dubbed the 2003 invasion of Iraq \"the worst foreign policy decision in U.S. history\" Almost 5,000 troops died in the conflict, while the total cost of the war was estimated to have been more than $2 trillion in 2013 . By one estimate, the Iraq war resulted in the deaths of at least 144,3 ."], [" As terrible as the Iraq war was, there have been plenty of other contenders for the worst foreign policy decision in U.S. history . The Vietnam War, for example, is another oft-cited debacle . Bay of Pigs, the CIA-sponsored military invasion of Cuba in 1961, is widely remembered as an absolute disaster ."], [" Your perspective on which foreign policy blunder was the worst likely depends on a variety of factors, including ideology and attitudes to history . Polls suggest that most Americans view the Iraq war as a mistake ."], [" The Iraq and Vietnam wars came in tied at third place with 8 percent of the vote . The only mistakes that placed higher were the treatment of Native Americans (with 12 percent) and slavery (with 30 percent)"]], "default_vector": [[-0.5931707620620728, 0.028376225382089615, -0.891535758972168, 0.40183842182159424, -0.1687505692243576, 0.7147959470748901, -0.3608459532260895, -0.03705207630991936, 0.20620863139629364, 0.5632576942443848, 0.5446891784667969, -0.4326464831829071, -0.09803123027086258, 0.21873857080936432, 0.21742326021194458, -0.1748518943786621, -0.06664138287305832, -0.1888