{"title": "How we are all contributing to the destruction of coral reefs: Sunscreen", "doc_id": "c6bdc765ba889f12d090f4e7ce48ad39", "author": "Darryl Fears", "annotation": "805-0", "published_date": "2015/10/20", "content_str": "The sunscreen that snorkelers, beachgoers and children romping in the waves lather on for protection is killing coral and reefs around the globe. And a new study finds that a single drop in a small area is all it takes for the chemicals in the lotion to mount an attack. The study, released Tuesday, was conducted in the U.S. Virgin Islands and Hawaii several years after a chance encounter between a group of researchers on one of the Caribbean beaches, Trunk Bay, and a vendor waiting for the day\u2019s invasion of tourists. Just wait to see what they\u2019d leave behind, he told the scientists \u2013 \u201ca long oil slick.\u201d His comment sparked the idea for the research. Not only did the study determine that a tiny amount of sunscreen is all it takes to begin damaging the delicate corals \u2014 the equivalent of\u00a0a drop of water in a half-dozen Olympic-sized swimming pools \u2014 it documented three different ways that the ingredient oxybenzone breaks the coral down, robbing it of life-giving nutrients and turning it ghostly white. [Scientists say a dramatic worldwide coral bleaching event is underway] Yet beach crowds aren\u2019t the only people\u00a0who add\u00a0to the demise of the coral reefs found just off shore. Athletes who slather sunscreen on before a run, mothers who coat their children before outdoor play and people trying to catch some rays in the park all come home and wash it off. Cities such as Ocean City, Md., and Fort Lauderdale, Fla., have built sewer outfalls that jettison tainted wastewater away from public beaches, sending personal care products with a cocktail of chemicals into the ocean. On top of that, sewer overflows during heavy rains spew millions of tons of waste mixed with stormwater into rivers and streams. Like sunscreen lotions, products like birth-control pills contain chemicals that are endocrine disruptors and alter the way organisms grow. Those are among the main suspects in an investigation into why male fish such as bass are developing female organs. Research for the new study was conducted only on the two islands. But across the world each year, up to 14,000 tons of sunscreen lotions are discharged\u00a0into coral reef, and much of it \u201ccontains between 1 and 10 percent oxybenzone,\u201d the authors said. They estimate that places at least 10 percent of reefs at risk of high exposure, judging from how reefs are located\u00a0in popular tourism areas. [Maryland\u2019s gigantic new oyster reef is a pearl that could save the Chesapeake Bay] \u201cThe most direct evidence we have is from beaches with a large amount of people in the water,\u201d said John\u00a0Fauth, an associate professor of biology at the University of Central Florida in Orlando. \u201cBut another way is through the wastewater streams. People come inside and step into the shower. People forget it goes somewhere.\u201d The study was published Tuesday in the journal Archives of Environmental Contamination and Toxicology. Fauth co-authored the study with Craig Downs of the nonprofit\u00a0Haereticus Environmental Laboratory in Clifford, Va., and Esti Kramarsky-Winter, a researcher \u00a0in the\u00a0Department of Zoology at\u00a0Tel Aviv University in Israel. Their findings follow a National Oceanic and Atmospheric Administration study two weeks ago that said the world is in the midst of a third global coral bleaching event. It warned that pollution is undermining the health of coral, rendering it unable to resist bleaching or recover from the effects. \u201cThe use of oxybenzone-containing products needs to be seriously deliberated in islands and areas where coral reef conservation is a critical issue,\u201d Downs said. \u201cWe have lost at least 80 percent of the coral reefs in the Caribbean. Any small effort to reduce oxybenzone pollution could mean that a coral reef survives a long, hot summer, or that a degraded area recovers.\u201d [As more bass switch sex, a strange fish story expands] Coral reefs are more than just exotic displays of color on the sea bed. The National Marine Fisheries Service, a division of the NOAA, placed their value for U.S. fisheries at $100 million. They spawn the fish humans eat and protect miles of coast from storm surge. \u201cLocal economies also receive billions of dollars from visitors to reefs through diving tours, recreational fishing trips, hotels, restaurants, and other businesses based near reef ecosystems,\u201d NOAA said on its Web site. \u201cGlobally, coral reefs provide a net benefit of $9.6 billion each year from tourism and recreation revenues, and $5.7 billion per year from fisheries.\u201d Oxybenzone is mixed in more than 3,500 sunscreen products worldwide, including popular brands such as Coppertone, Baby Blanket Faces, L\u2019Oreal Paris, Hawaiian Tropic and Banana Boat. Adverse effects on coral started on with concentrations as low as 62 parts per trillion. There are alternative sunscreens with no oxybenzone, including a product called Badger Natural Sunscreen and dozens of others on a list provided by the non-profit Environmental Working Group. Measurements of oxybenzone in seawater within coral reefs in Hawaii and the U.S. Virgin Islands found concentrations ranging from 800 parts per trillion to 1.4 parts per million,\u201d according to the authors. That\u2019s 12 times the concentrations needed to harm coral. \u201cThis study raises our awareness of a seldom-realized threat to the health of our reef life \u2026 chemicals in the sunscreen products visitors and residents wear are toxic to young corals,\u201d said Pat Lindquist, executive director of the Napili Bay and Beach Foundation in Maui. \u201cThis knowledge is critical to us as we consider actions to mitigate threats or improve on current practices.\u201d Read more in Science and Energy & Environment: The big fish story everyone is missing in the western drought Sea stars are wasting away in larger numbers on a wider scale in two oceans Crabs are bulking up on carbon pollution to become giants For more, you can sign up for our weekly newsletter here, and\u00a0follow us on Twitter here.", "default_text": [[" The study was conducted in the U.S. Virgin Islands and Hawaii . It documented three ways that the ingredient oxybenzone breaks the coral down, robbing it of life-giving nutrients ."], [" Athletes who slather sunscreen on before a run, mothers who coat their children before outdoor play and people trying to catch some rays in the park all come home and wash it off . Cities such as Ocean City, Md., and Fort Lauderdale, Fla., have built sewer outfalls that jettison tainted wastewater away from public beaches ."], [" Up to 14,000 tons of sunscreen lotions are discharged into coral reef each year . Much of it \u201ccontains between 1 and 10 percent oxybenzone,\u201d the authors said . They estimate that places at least 10 percent of reefs at risk of high exposure ."], [" Coral reefs are more than just exotic displays of color on the sea bed . They spawn the fish humans eat and protect miles of coast from storm surge . The National Marine Fisheries Service placed their value for U.S. fisheries at $100 million ."], [" Oxybenzone is mixed in more than 3,500 sunscreen products worldwide . Adverse effects on coral started on with concentrations as low as 62 parts per trillion . There are alternative sunscreens with no oxybenzone, including Badger Natural Sunscreen ."], [" Chemicals in sunscreen products visitors and residents wear are toxic to young corals . That\u2019s 12 times the concentrations needed to harm coral . \u201cThis knowledge is critical to us as we consider actions to mitigate threats or improve on current practices.\u201d"]], "default_vector": [[-0.2571951448917389, 0.16366927325725555, 0.176064