{"title": "A group broke into DeSean Jackson\u2019s home in Los Angeles, attacking its residents", "doc_id": "194536e76ebe0e34a184a8fa94684119", "author": "Clinton Yates", "annotation": "805-0", "published_date": "2015/10/23", "content_str": "DeSean Jackson\u2019s rocky season just got worse. The Washington Redskins wide receiver \u2014 who\u2019s been sidelined since Week 1 with an injury \u2014 had his house broken into by a group of people with guns last night in Los Angeles, according to TMZ. Jackson, who is from Los Angeles, was not home at the time, but six people who were at the house tried to fight off the intruders, TMZ reports. One person was pistol-whipped and suffered minor injuries. DeSean Jackson\u2019s alleged affiliation with gang members is a story that\u2019s followed him for some time in his NFL career, long before he arrived in Ashburn. TMZ reports that it\u2019s possible the home invasion was gang-related, and that Jackson was not the target of the home invasion. More immediately for fans of the team, however, are the striking similarities this situation has to the incident that led to the death of Sean Taylor in 2007. While on a bye week, Taylor died a day after being shot during a home invasion at his\u00a0Palmetto Bay house in Florida. The killer was sentenced in January of last year to 57.5 years in prison for murder.", "default_text": [[" DeSean Jackson's house was broken into by a group of people with guns last night in Los Angeles . Jackson was not home at the time, but six people who were at the house tried to fight off the intruders . TMZ reports that it\u2019s possible the home invasion was gang-related ."], [" January of last year to 57.5 years in prison for murder for murder ."]], "default_vector": [[-0.23393787443637848, 0.0028735448140650988, -0.2237371802330017, 0.05397864058613777, 0.4686777889728546, 0.18062706291675568, 0.28261545300483704, -0.6730453372001648, -0.3160616457462311, 0.29165413975715637, -0.17682717740535736, 0.2